  `mov_director` varchar(50) DEFAULT NULL COMMENT '导演',
  `mov_leadActor` varchar(255) DEFAULT NULL COMMENT '主演',
  `mov_summary` text COMMENT ' 电影简介',
  `mov_downloadUrl` varchar(1000) DEFAULT NULL COMMENT '下载地址',
