  `mov_poster` varchar(1000) DEFAULT NULL COMMENT '电影海报',
  `mov_stills` varchar(1000) DEFAULT NULL COMMENT '电影截图,',
  `create_date` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
