INSERT INTO `blog_movie` VALUES ('1116', '伦敦陷落/白宫沦陷2：伦敦沦陷(港)/全面攻占2：伦敦救援(台)', 'London Has Fallen', '2016', '英国/美国/保加利亚', '动作/犯罪/惊悚', '英语', '中英双字幕', '&nbsp; 6.0/10 from 39,849 users', 'BD-MKV', '1280 x 720', '1CD', '98分钟(中国大陆)/99分钟', '巴巴克&middot;纳加非 Babak Najafi', '杰拉德&middot;巴特勒 Gerard Butler 饰 麦克&middot;班宁 Mike Banning 艾伦&middot;艾克哈特 Aaron Eckhart 饰 本杰明&middot;阿瑟总统 Benjamin Asher 摩根&middot;弗里曼 Morgan Freeman 饰 特鲁姆布尔议长 VP Trumbull 阿隆&middot;阿布布尔 Alon Aboutboul 饰 阿米尔&middot;巴卡维 Aamir Barkawi 安吉拉&middot;贝塞特 Angela Ba', '英国首相神秘逝世，美国特勤局特工班宁（杰拉德&middot;巴特勒饰）将配合特勤局局长琳&middot;雅各布（安吉拉&middot;贝塞特饰）做好准备，陪同本杰明&middot;阿瑟总统（艾伦&middot;艾克哈特饰）前往伦敦圣保罗教堂参加英国首相的国葬仪式。 由于所有大国首脑都必然要出席，这场葬礼理应是全世界安保最严密的活动。然而，各国首脑刚刚抵达不久便遭遇暗杀，伦敦地标建筑也纷纷遭袭。阿瑟、班宁和雅各布也遭到伏击，在连天的炮火和爆炸中撤退。满目疮痍的英国首都进入封锁状态。奉雅各布之命保护阿瑟总统的班宁必须躲开敌人的视线，抢在对手的前头先下手为强，不惜一切代价保护阿瑟总统安全回国。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8088/[阳光电影www.ygdy8.com].伦敦沦陷.BD.720p.国英双语.中英双字幕.mkv', 'http://www.dytt8.net/html/gndy/dyzz/20160602/51104.html', 'http://pic.yupoo.com/hdarea/FAJlQ6ZZ/ZCHJY.jpg', 'http://i2.buimg.com/bda3e671a788a859.jpg', '2016-06-25 15:38:50');
INSERT INTO `blog_movie` VALUES ('1129', '意外制造公司', 'De Surprise', '2015', '荷兰/比利时/德国/爱尔兰', '剧情/爱情', '荷兰语', '中文', '6.7/10 from 1,049 users', 'BD-RMVB', '1280 x 720', '1CD', '102分钟', '麦克&middot;范&middot;迪亚姆 Mike van Diem', '杰罗恩&middot;凡&middot;康宁斯伯格 Jeroen van Koningsbrugge 乔治娜&middot;芜班 Georgina Verbaan 简&middot;德克莱尔 Jan Decleir 亨利&middot;古德曼 Henry Goodman 安刻尔&middot;巴尔 Ankur Bahl 纳维德&middot;乔杜里 Naveed Choudhry 奥利弗&middot;加茨 Oliver Gatz 罗尼&middot;尤提 Ronny Jhutti', '个性古怪的单身富豪一心求死，多次自杀失败只好寻求专业协助。他找上专门安排客制化死亡方案的神秘公司「极乐世界」，合约一旦签定，就不能反悔。富豪对人世毫无眷恋，选择「意外」方案，任由公司量身订作。他巧遇签了相同合约的年轻女子，棺材还没选好却先对她一见钟情。人生诸多意外，富豪这才真正意识到即将到来的「意外」已经无法终止&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9108/[阳光电影www.ygdy8.com].意外制造公司.BD.720p.中文字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160516/50995.html', 'http://i3.piimg.com/f9e0b61f98365d32.jpg', 'http://i4.buimg.com/7d3897a887288ffc.jpg', '2016-06-25 15:38:50');
INSERT INTO `blog_movie` VALUES ('1183', '硬核亨利/爆机特攻(港)/超狂亨利(台)/硬核大战/硬汉亨利/硬仗/硬核', 'Хардкор/Hardcore Henry / Hardcore', '2015', '俄罗斯/美国', '动作/科幻/冒险', '英语/俄语', '中英双字幕', '6.9/10 from 19,128 users', 'HD-RMVB', '1280 x 720', '1CD', '96分钟', '伊利亚&middot;奈舒勒 Ilya Naishuller', '沙尔托&middot;科普雷 Sharlto Copley 丹尼拉&middot;科兹洛夫斯基 Danila Kozlovsky 海莉&middot;贝内特 Haley Bennett 安德烈&middot;杰缅季耶夫 Andrei Dementiev 达雅&middot;查库莎 Darya Charusha 斯薇坦娜&middot;乌斯蒂诺娃 Svetlana Ustinova 威尔&middot;斯图尔特 Will Stewart 伊利亚&middot;奈舒勒 Ilya Naishuller', '本片根据导演上一部拍摄的短片《Bad Motherfucker》改编而成，全程镜头以第一人称视角展现，给人以经典射击游戏《绝对武力》的即视感。 亨利从死亡边缘幸存后，以超级特工的身份试图从火力强大的生化武器军人手中挽救他的妻子，同时他也必须提防自己的身份不被发现。◎获奖情况 第40届多伦多国际电影节&nbsp; (2015) 观众选择奖 午夜疯狂单元 伊利亚&middot;奈舒勒', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8129/[阳光电影www.ygdy8.com].硬核亨利.HD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160622/51282.html', 'http://i4.piimg.com/549473/1e1dac97ee266cb3.jpg', 'http://i4.piimg.com/549473/28f1f24acf379868.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1184', '功夫熊猫3/熊猫阿宝3', 'Kung Fu Panda 3', '2016', '中国/美国', '喜剧/动作/动画/冒险', '英语/国语', '中英双字幕', '7.5/10 from 22,264 users', 'x264 + AAC', '1280 x 720', '1CD', '95分钟', '余仁英 Jennifer Yuh / Alessandro Carloni', '杰克&middot;布莱克 Jack Black 布莱恩&middot;科兰斯顿 Bryan Cranston 达斯汀&middot;霍夫曼 Dustin Hoffman 安吉丽娜&middot;朱莉 Angelina Jolie J&middot;K&middot;西蒙斯 J.K. Simmons 成龙 Jackie Chan 塞斯&middot;罗根 Seth Rogen 刘玉玲 Lucy Liu 大卫&middot;克罗斯 David Cross 凯特&middot;哈德森 Kate Hudson ', '在新一集故事里，阿宝（杰克&middot;布莱克 Jack Black 配音）失散已久的亲生父亲突然现身，重逢的父子二人一起来到了一片不为人知的熊猫乐土。在这里，阿宝遇到了好多滑稽的熊猫同类。当拥有神秘力量的大反派天煞（J&middot;K&middot;西蒙斯 J.K. Simmons 配音）横扫神州大地，妄图残害所有功夫高手时，阿宝必须迎难而上，学着把那些热爱享乐、笨手笨脚的熊猫村民训练成一班所向披靡的功夫熊猫！', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8098/[阳光电影www.ygdy8.com].功夫熊猫3.BD.720p.国英双语.中英双字幕.mkv', 'http://www.dytt8.net/html/gndy/dyzz/20160616/51240.html', 'http://i4.buimg.com/c8c34b55386e28d2.jpg', 'http://i2.buimg.com/5872f8eeacecc4ca.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1185', '破碎人生/愛情上半場?完/崩坏人生/爆破/拆除', 'Demolition', '2015', '美国', '剧情/喜剧', '英语', '中英双字幕', '7.5/10 from 6,317 users', 'BD-RMVB', '1280 x 720', '1CD', '100分钟', '让-马克&middot;瓦雷 Jean-Marc Vall&eacute;e', '杰克&middot;吉伦哈尔 Jake Gyllenhaal 娜奥米&middot;沃茨 Naomi Watts 克里斯&middot;库珀 Chris Cooper 希瑟&middot;林德 Heather Lind 犹大&middot;刘易斯 Judah Lewis 沃斯&middot;史蒂文斯 Wass Stevens 波利&middot;德雷珀 Polly Draper 布兰登&middot;杜林 Brendan Dooling 阿尔弗雷多&middot;纳西索 Alfredo Narciso 西', '《爆破》由布莱恩&middot;赛普（Bryan Sipe）编剧，故事讲述杰克&middot;吉伦哈尔（Jake Gyllenhaal）饰演的一位投资银行家在妻子遭遇意外身亡后，生活变得支离破碎，直到遇到了娜奥米&middot;沃茨（Naomi Watts）饰演的单亲妈妈，人生才有了转机。 据悉，娜奥米&middot;沃茨饰演的这位单亲妈妈是一个和又老板约会、又吸大麻的客户服务代表，她的公司专门生产自动贩卖机。她和男主角的相遇也充满戏剧性，男主角的钱被自动贩卖机吞了，她去处理投诉时了解到了男主角的不幸遭遇，继而与他有了进一步的接触。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9129/[阳光电影www.ygdy8.com].破碎人生.HD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160623/51288.html', 'http://i2.piimg.com/549473/2d20005102390032.jpg', 'http://i2.piimg.com/549473/d2128871f94bc17c.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1186', '分歧者3：忠诚世界/效忠者(上)/分歧者3：效忠者(上)/分歧者3：忠诚者(上)/赤诚者:末世醒觉(港)/分歧者3：赤诚者(台)/忠诚者(上)', 'The Divergent Series: Allegiant/Allegiant: Part 1', '2016', '美国', '动作/爱情/科幻/冒险', '英语', '中英双字幕', '6.0/10 from 22,000 users', 'HD-RMVB', '1280 x 720', '1CD', '2h 0mn', '罗伯特&middot;斯文克&nbsp; Robert Schwentke', '谢琳&middot;伍德蕾 Shailene Woodley 提奥&middot;詹姆斯 Theo James 杰夫&middot;丹尼尔斯 Jeff Daniels 奥克塔维亚&middot;斯宾瑟 Octavia Spencer 雷&middot;史蒂文森 Ray Stevenson 佐伊&middot;克罗维兹 Zo? Kravitz 迈尔斯&middot;特勒 Miles Teller 安塞尔&middot;艾尔高特 Ansel Elgort 李美琪 Maggie Q 比尔&middot;斯卡斯加', '派系制度瓦解后，分歧者翠丝（谢琳&middot;伍德蕾饰）揭开了整个人类的秘密，原来芝加哥不过是美国基因局制造的一场实验。一片混乱之下的芝加哥危机四伏，老四的母亲伊芙琳（娜奥米&middot;沃茨饰）组织了强有力的武装力量，企图占领芝加哥成为新的统治者。翠丝决定带领老四（提奥&middot;詹姆斯饰）、克里斯蒂娜（佐伊&middot;克拉维兹饰）、皮特（迈尔斯&middot;特勒饰）、托莉（Maggie Q饰）和凯莱布（安塞尔&middot;埃尔格特饰）逃往芝加哥城外的世界，为芝加哥人民寻找新的希望。他们历经险阻成功逃脱，终于来到了墙外的神秘世界&mdash;&mdash;充斥着各种高科技技术的基因局。在这个全新的世界里，翠丝和老四的价值观被完全颠覆，二人之间的信任也遭受到前所未有的考验。当他们终于发现了基因局负责人大卫（杰夫&middot;丹尼尔斯饰）所谓的&ldquo;神秘事业&rdquo;背后所掩藏的更大阴谋时，却没有察觉自己其实早已被卷入了其中。为了保护芝加哥的人民，翠丝和老四做出了忠于内心的选择，他们要联合所有派系向墙外世界宣战！他们以卵击石的背水一战究竟能否颠覆世界？', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8101/[阳光电影www.ygdy8.com].分歧者3：忠诚世界.HD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160620/51264.html', 'http://i4.buimg.com/faf19d355781ccb3.jpg', 'http://i4.buimg.com/846214c65187992d.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1187', '猎神：冬日之战/猎神：魔雪叛變(港)/狩猎者：凛冬之战/猎人：冬之战/猎人：冬日之战/白雪公主与猎人2', 'The Huntsman: Winter s War', '2016', '美国', '剧情/动作/奇幻/冒险', '英语', '中英双字幕', '6.2/10 from 24,077 users', 'HD-RMVB', '1280 x 720', '1CD', '1h 53mn', '塞德里克&middot;萨科 Cedric Nicolas-Troyan', '克里斯&middot;海姆斯沃斯 Chris Hemsworth  查理兹&middot;塞隆 Charlize Theron  艾米莉&middot;布朗特 Emily Blunt  杰西卡&middot;查斯坦 Jessica Chastain  尼克&middot;弗罗斯特 Nick Frost  山姆&middot;克拉弗林 Sam Claflin  罗伯&middot;布莱顿 Rob Brydon  科林&middot;摩根 Colin Morgan  索菲&middot;库克森 Sophie ', '故事发生在白雪公主的故事之前和之后的7年，冰雪女王弗雷娅（艾米莉&middot;布朗特 Emily Blunt 饰）是邪恶女王拉文纳（查理兹&middot;塞隆 Charlize Theron 饰）的妹妹。拉文纳通过魔镜得知妹妹的女儿将会成为世界上最美的女人，弗雷娅在一次&ldquo;意外&rdquo;中失去了孩子。丧子之痛激发了弗雷娅巨大的魔力，从一个善良温 柔的女人变成了冷酷无情的冰雪女王，不仅创建了千里冰封的冰雪王国，更是在王国内制定了&ldquo;不准相爱&rdquo;的规则。猎神埃里克（克里斯&middot;海姆斯沃斯 Chris Hemsworth 饰）与女勇士萨拉（杰西卡&middot;查斯坦 Jessica Chastain 饰）的爱情之路正是由此开始，作为弗雷娅培养的部下，二人经历艰难后将合力对抗两大女王，这不仅是一场为爱而展开的斗争，更是一场推翻女王统治的为争取自 由而引发的正邪大战。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8099/[阳光电影www.ygdy8.com].猎神：冬日之战.HD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160617/51247.html', 'http://i2.buimg.com/e6656697332ac870.jpg', 'http://i2.buimg.com/c70a64da23fff5d1.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1188', '亡界之门/鬼门开(台)', 'The Other Side of the Door', '2016', '印度/英国', '恐怖', '英语', '中英双字幕', '&nbsp; 5.3/10 from 1,536 users', 'BD-RMVB', '1280 x 720', '1CD', '1h 36mn', '约翰内斯&middot;罗伯茨 Johannes Roberts', '莎拉&middot;韦恩&middot;卡丽丝 Sarah Wayne Callies  杰瑞米&middot;西斯托 Jeremy Sisto  哈维尔&middot;博特 Javier Botet  索菲亚&middot;罗新斯基 Sofia Rosinsky  洛根&middot;克里伦 Logan Creran  贾克斯&middot;马尔科姆 Jax Malcolm  苏奇拉&middot;皮莱-马利克 Suchitra Pillai-Malik &nbsp;', '故事发生在印度孟买，六年前，从事贸易工作的迈克（杰瑞米&middot;西斯托 Jeremy Sisto）突然得知妻子玛丽娅（莎拉&middot;韦恩&middot;卡丽丝 Sarah Wayne Callies 饰）怀孕的消息。在人生最幸福的时刻，他决定定居印度，婚后不久儿子奥利弗（洛根&middot;克里伦 Logan Creran 饰）和女儿露西（索菲亚&middot;罗新斯基 Sofia Rosinsky 饰）接连降生。但是一次意外车祸让玛丽娅不得不在两个孩子之间做出抉择，她也由此痛失爱子。此后的岁月里，玛丽娅始终沉浸在深深的自责之中无法自拔，绝望促使她饮药自尽。从昏迷中醒来后，印度女仆告诉她一个可以和死去儿子见面的办法。  家庭破败的边缘，以及对儿子深深的思念，终于让玛丽娅决心走向阴阳两界&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9063/[阳光电影www.ygdy8.com].亡界之门.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160528/51072.html', 'http://www.geehd.com/data/attachment/forum/201605/24/110147o0s73fm0g92gbubg.jpg', 'http://i4.buimg.com/4c1000f91c6d3b69.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1189', '洛洛', 'Lolo', '2015', '法国', '喜剧', '法语', '中文', '&nbsp; 6.0/10 from 380 users', 'BD-RMVB', '1280 x 720', '1CD', '99分钟(法国)', '朱莉&middot;德尔佩 Julie Delpy', '朱莉&middot;德尔佩 Julie Delpy 丹尼&middot;伯恩 Dany Boon 文森特&middot;拉科斯特 Vincent Lacoste 嘉莲&middot;维雅 Karin Viard 乔治斯&middot;科拉菲斯 Georges Corraface', '瓦蕾特在时装行业工作，40岁了依然是个工作狂。她和她最好的朋友在做SPA时，爱上了一个粗俗的电脑极客让雷内。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9072/[阳光电影www.ygdy8.com].洛洛.BD.720p.中文字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160615/51234.html', 'http://pic.yupoo.com/hdarea/FmJPe6my/z0iL3.jpg', 'http://i4.buimg.com/4412df7f19356ee3.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1190', '午夜逃亡/通天眼(台)/午夜特快', 'Midnight Special', '2016', '美国', '剧情/科幻/冒险', '英语', '中英双字幕', '7.0/10 from 12612 users', 'BD-RMVB', '1280 x 720', '1CD', '1h 51mn', '杰夫&middot;尼克尔斯 Jeff Nichols', '迈克尔&middot;珊农 Michael Shannon 乔尔&middot;埃哲顿 Joel Edgerton 克斯汀&middot;邓斯特 Kirsten Dunst 亚当&middot;德赖弗 Adam Driver 杰顿&middot;李博赫 Jaeden Lieberher 山姆&middot;夏普德 Sam Shepard 斯科特&middot;黑兹 Scott Haze 比尔&middot;坎普 Bill Camp 保罗&middot;斯帕克斯 Paul Sparks 丹娜&middot;', '故事将围绕一对父子展开，有一天父亲忽然发现自己8岁的儿子有一种&ldquo;特异功能&rdquo;，之后他们就踏上了逃亡之路。◎花 絮&middot;据导演尼科尔斯透露，亚当&middot;德赖弗在片场第一天接到了他将在《星球大战7》中出演的消息。&middot;电影总共花费40天拍摄完成。成本1800万美元。&middot;杰夫&middot;尼科尔斯迄今执导的《**故事》、《寻求庇护》、《污泥》和《午夜特快》四部作品，每一部中都有迈克尔&middot;珊农出演。&middot;影片由华纳兄弟制作和发行，也是尼科尔斯第一部同大制片厂合作的影片。&middot;影片原定2015年12月25日上映，后推迟到2016年的3月，中间参加了三大电影节的柏林，入围主竞赛单元。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8122/[阳光电影www.ygdy8.com].午夜逃亡.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160609/51194.html', 'http://i2.buimg.com/9c21649e58ffd161.jpg', 'http://i4.buimg.com/38f79237348f476d.jpg', '2016-06-25 15:40:11');
