INSERT INTO `blog_movie` VALUES ('1192', '天空之眼/天眼行动(台)', 'Eye in the Sky', '2015', '英国', '剧情/战争/惊悚', '英语', '中英双字幕', '7.7/10 from 9,160 users', 'BD-RMVB', '1280 x 720', '1CD', '102分钟', '加文&middot;胡德 Gavin Hood', '海伦&middot;米伦 Helen Mirren 亚伦&middot;保尔 Aaron Paul 艾伦&middot;瑞克曼 Alan Rickman 巴克德&middot;阿巴蒂 Barkhad Abdi 杰瑞米&middot;诺森 Jeremy Northam 伊恩&middot;格雷 Iain Glen 菲比 福克斯 Phoebe Fox 阿曼&middot;哈格伊 Armaan Haggio 艾莎&middot;塔蔻 Aisha Takow 理查德&middot;麦凯布 Richard McCa', '凯瑟琳上校（海伦&middot;米伦 Helen Mirren 饰）率英国情报单位追捕一名女性恐怖分子长达六年，经由美军加入高空监视行动，好不容易在秘密基地找到疑似她的身影，特种部队准备活捉她时，高空侦查人员却意外发现该名恐怖分子正与其他人密谋自杀炸弹攻击，为了防止伤害，凯瑟琳下令轰炸秘密基地将敌人歼灭。当无人战斗机的驾驶员史蒂夫（亚伦&middot;保尔 Aaron Paul 饰）瞄准目标后，却发现这个&ldquo;秘密基地&rdquo;竟然是普通的民居，而一名女孩更是跑进他的攻击范围玩耍，原本单纯的跨国逮捕行动瞬间变成复杂难解的反恐任务&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9125/[阳光电影www.ygdy8.com].天空之眼.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160612/51212.html', 'http://i2.buimg.com/471a247a3b18085b.jpg', 'http://i2.buimg.com/e4f3790388272a93.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1193', '危机13小时/13小时：班加西无名英雄(港)/13小时：班加西的秘密士兵(台)', '13 Hours: The Secret Soldiers of Benghazi', '2016', '美国', '剧情/动作/战争/惊悚', '英语', '中英双字幕', '&nbsp; 7.5/10 from 13,912 users', 'BD-RMVB', '1280 x 720', '1CD', '144分钟', '迈克尔&middot;贝 Michael Bay', '詹姆斯&middot;戴尔 James Badge Dale 饰 泰隆 Tyrone \'Rone\' Woods 约翰&middot;卡拉辛斯基 John Krasinski 饰 杰克 Jack Silva 马克斯&middot;马蒂尼 Max Martini 饰 马克 Mark \'Oz\' Geist 多米尼克&middot;福穆萨 Dominic Fumusa 饰 约翰 John \'Tig\' Tiegen 巴勃罗&middot;施瑞博尔 Pablo Schreiber 饰 克里斯 Kris \'Tanto\'', '迈克尔&middot;贝导的这部新片根据米切尔&middot;朱可夫（Mitchell Zuckoff）同名小说改编，是一部政治题材的电影。2012年9月11日，在利比亚班加西的美国领事馆前发生一起反美示威事件，入夜后数十名武装分子冲进领事馆，示威演变为暴力冲突，最终导致包括美国大使约翰&middot;克里斯托弗&middot;史蒂文斯（Christopher J. Stevens）在内的四人死亡，这也是33年以来第一个被恐怖分子杀害的美国大使，影片《危机13小时》就是由这一真实事件取材。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9115/[阳光电影www.ygdy8.com].危机13小时.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160527/51066.html', 'http://pic.yupoo.com/hdarea/FzNGpsrK/FA4ba.jpg', 'http://i2.buimg.com/e09e86f371a56f98.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1194', '灵偶契约/尸孩(港)/托阴(台)/木偶男孩/小男孩/男孩', 'The Boy', '2016', '美国', '惊悚/恐怖', '英语', '中英双字幕', '6.0/10 from 15,590 users', 'BD-RMVB', '1280 x 720', '1CD', '97分钟', '威廉&middot;布伦特&middot;贝尔 William Brent Bell', '劳伦&middot;科汉 Lauren Cohan 鲁珀特&middot;伊文斯 Rupert Evans 吉姆&middot;诺顿 Jim Norton 黛安娜&middot;哈卡索 Diana Hardcastle 本&middot;罗伯森 Ben Robson 詹姆斯&middot;罗素 James Russell 杰特&middot;克莱恩 Jett Klyne 莉莉&middot;佩特 Lily Pater 马修&middot;沃克 Matthew Walker 斯蒂芬妮&middot;勒梅林 ', '在英国郊外某个安静的角落，耸立着豪华考究的别墅。这幢别墅属于年迈的希夏尔先生（吉姆&middot;诺顿 Jim Norton 饰）和希夏尔太太（黛安娜&middot;哈卡索 Diana Hardcastle 饰）夫妇。这一天，别墅迎来了一个年轻女孩。女孩名叫格丽塔（劳伦&middot;科汉 Lauren Cohan 饰），因某些原因他希望逃离之前的生活，同时也是受雇于希夏尔完成一项奇怪的工作。希夏尔夫妇即将外出度假，他们要求格丽塔在此期间照顾他们的&ldquo;儿子&rdquo;布拉姆斯&mdash;&mdash;一个男孩模样的人偶。格丽塔起初感到好笑，但看到夫妇俩一本正经的模样也便尽可能控制自己的好奇心。夫妇为格丽塔规定了不可逾越的条款，但是当他们离开后，格丽塔却最终逾越了戒条。 令她难以置信的是，布拉姆斯仿佛真的拥有鲜活的生命&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8064/[阳光电影www.ygdy8.com].灵偶契约.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160429/50832.html', 'http://i4.piimg.com/f7beaa7afe673100.jpg', 'http://i2.piimg.com/5295db4e780dd4a5.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1195', '飞鹰艾迪/飞跃奇迹(台)/我要做鹰雄(港)', 'Eddie the Eagle', '2016', '英国/美国/德国', '传记/喜剧/剧情/运动', '英语', '中英双字幕', '7.5/10 from 17,844 users', 'BD-RMVB', '1280 x 720', '1CD', '105 Mins', '德克斯特&middot;弗莱彻Dexter Fletcher', '塔伦&middot;埃格顿Taron Egerton ....Eddie Edwards 休&middot;杰克曼Hugh Jackman ....Bronson Peary 艾芮丝&middot;贝本Iris Berben ....Petra 麦德斯&middot;斯加德&middot;彼得森Mads Sj?g?rd Pettersen ....Erik Moberg 蒂姆&middot;麦克纳尼Tim McInnerny ....Dustin Target Tom Costello ....Eddie', '《飞鹰埃迪》聚焦艾迪&middot;爱德华兹在1988年冬奥会上的成名故事。&ldquo;飞鹰艾迪&rdquo;艾迪&middot;爱德华兹这位患有高度近视的英国跳台滑雪运动员在1988年卡尔加里冬奥会排名倒数第一，奇怪的是，许多人都觉得他的糟糕的比赛成绩反而成了幽默的源泉，艾迪因此而声名鹊起。1990年奥委会出台了一条新规，规定凡是想代表本国参加奥运会的运动员必须是世界上最顶尖的选手。这条规则被人们称之为&ldquo;飞鹰规则&rdquo;。休&middot;杰克曼饰演的过气滑雪明星查克&middot;伯霍恩不仅是埃迪&middot;爱德华的教练，也是他心灵上的导师。 详述了英国历史上最著名的跳台滑雪运动员，有&ldquo;飞鹰艾迪&rdquo;之称的迈克尔&middot;爱德华兹激励人心的真实事迹。影片刻画了艾迪在运动赛场上永不言弃的宝贵精神，赞扬了他在面对巨大困难和挑战时所表现的非凡毅力和乐观精神。 影片的男主人公&ldquo;飞鹰&rdquo;艾迪，由曾在《王牌特工：特工学院》中有杰出表现的新晋英国小生塔伦&middot;埃格顿饰演，而好莱坞著名影星&ldquo;金刚狼&rdquo;休&middot;杰克曼也重磅加盟，饰演艾迪的教练，为帮他圆梦卡尔加里冬奥会，对他进行严格训练。冬奥会上艾迪有趣又颇具历史性的展示让他名声鹊起，成为记者关注的焦点人物，并俘获了全世界观众的心。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8094/[阳光电影www.ygdy8.com].飞鹰艾迪.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160610/51200.html', 'http://pic.yupoo.com/arthurfihd/FBTTy8ZV/xgpAo.jpg', 'http://i2.buimg.com/87cdffee75797dbf.jpg', '2016-06-25 15:40:11');
INSERT INTO `blog_movie` VALUES ('1196', '启功', 'The Calligraphy Master', '2015', '中国', '剧情/传记', '普通话', '中文/英文', '5.8/10 10 votes', 'HD-RMVB', '1280 x 720', '1CD', '1h 37mn', '丁荫楠 Yinnan Ding', '马恩然 Enran Ma  王馥荔 Fuli Wang  孔祥玉 Xiangyu Kong.  张绍刚 Shaogang Zhang  张炜迅 Weixun Zhang  刘琳 Lin liu  叮当 Dang Ding  娜仁花 Renhua Na  杨立新 LiXin Yang  程前 Qian Cheng', '文革期间，一生兢兢业业以教育为毕生事业的书画家启功（马恩然 饰）平静的生活被打破。显赫的帝胄家世，即使摘掉了右派的帽子，在那个特殊的年代也依旧避免不了浩浩荡荡的思想改造运动，由于擅长书法，红卫兵队长刘雨辰安排启功负责摘抄大字报。一切教学研究、书法创作活动的中止，带给启功生活上的窘迫令他一度开始怀疑自己的创作，甚至想烧掉自己毕生研究的心血，身患重病不离不弃的妻子鼓励启功继续坚持自己的事业。红卫兵的搜查让启功销毁不少珍贵的文物字画，尘封的往事随着字画浮现眼前。 启功少年时代接受祖父的艺术熏陶，痴迷于作画，后拜书画大师溥心畲为师潜心学习，颇有成就，宗亲纷纷来求画却因字丑不许他落款，启功从此发奋练习书法。中年时期的启功被辅仁大学校长陈垣先生提携，介绍进入辅仁中学教国文，因学历不够被辞退，走投无路之际，陈垣校长又伸出援手，破格让他到辅仁大学当助教，陈垣校长悉心指导栽培启功，师生情谊真挚感人，启功更以&ldquo;学为人师，行为世范&rdquo;当做自己一生所求。 改革开放后，启功先生成为了享誉国内外的大师，他笔耕不辍，继续为教育事业奋斗。为了恩泽下一代年轻人，他将自己书画作品义卖所得的资金成立了励耘奖学金，启功先生高尚的品格，伟大的情怀堪称圣贤。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8085/[阳光电影www.ygdy8.com].启功.HD.720p.国语中字.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160530/51083.html', 'http://i2.buimg.com/4e230e8c7662ce61.jpg', 'http://i1.buimg.com/6c9e17b0543d4371.jpg', '2016-06-25 15:40:11');
