INSERT INTO `blog_movie` VALUES ('1200', '接着侵略哪儿/下一步占领哪(台)', 'Where to Invade Next', '2015', '美国', '纪录片', '英语', '中英双字幕', '&nbsp; 7.3/10 from 2,846 users', 'BD-RMVB', '1280 x 720', '1CD', '119分钟', '迈克尔&middot;摩尔 Michael Moore', 'Krista Kiuru 迈克尔&middot;摩尔 Michael Moore Tim Walker', 'To learn what the USA can learn from other nations, Michael Moore playfully &quot;invades&quot; them to see what they have to offer.◎获奖情况 第21届美国评论家选择电影奖&nbsp; (2016) 最佳纪录片(提名)', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9066/[阳光电影www.ygdy8.com].接着侵略哪儿.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160602/51103.html', 'http://i2.buimg.com/a9165e525960d89e.jpg', 'http://i2.buimg.com/4e76ff041487cce9.jpg', '2016-06-25 15:40:12');
INSERT INTO `blog_movie` VALUES ('1201', '镭射小队/拉泽团队/激光小队', 'Lazer Team', '2015', '美国', '动作/喜剧/科幻', '英语', '中英双字幕', '7.6/10 from 1,154 users', 'BD-RMVB', '1280 x 720', '1CD', '1h 42mn', 'Matt Hullum', '阿兰&middot;里奇森 Alan Ritchson 亚历山德里娅&middot;德伯里 Alexandria Deberry Burnie Burns', '地球上的居民收到来自外太空的编码信息，告诉他们，他们并不孤单，银河系是一个危险的地方。  经过数十亿年的思考，我们在我们解码消息（60年代），宇宙中孤独告诉我们，我们并不孤单，和宇宙是一个危险的地方，而我们会被攻击。幸运的是，该编码的消息从一个友好的外星种族的父亲和保护我们多年来来了。而现在，他们正在给我们的工具来反击（格式为动力装甲）。但快递服务需要较长时间（我假设了30分钟，因为他们得到的西装免费），并在这些loooong十年等待的货船与他们的一个电源套装到货，他们选择地以一个冠军训练穿的西装，保卫地球！然后，船终于到达......只拿到击落4白痴谁与西装打，最终得到一件每个粘在上面。现在，他们需要与政府合作，培养这4个低能儿与连接到他们的个人作品。他们将节省一天还是会站在一旁盘算的生活吗？', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8114/[阳光电影www.ygdy8.com].镭射小队.HD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160526/51052.html', 'http://www.bilibt.com/upload/attach/099/007/4d0bd7f5fc56d009495f49795a6db31e.jpg', 'http://i2.buimg.com/9eae0fab5b2618de.jpg', '2016-06-25 15:40:12');
INSERT INTO `blog_movie` VALUES ('1202', '神父俱乐部/赎罪俱乐部(台)', 'El club', '2015', '智利', '剧情', '西班牙语', '中英双字幕', '&nbsp; 7.4/10 from 2,732 users', 'BD-RMVB', '1280 x 720', '1CD', '98分钟', '帕布罗&middot;拉雷恩 Pablo Larra&iacute;n', '罗伯托&middot;法里亚斯 Roberto Farias 安东尼娅&middot;泽格斯 Antonia Zegers 阿尔佛莱德&middot;卡斯特罗 Alfredo Castro Alejandro Goic Alejandro Sieveking Jaime Vadell Marcelo Alonso', '修女莫妮卡与一群年龄各异的牧师共同住在智利海岸边的一所房子里。在每天祈祷和做忏悔之余，他们训练灵缇犬（Greyhound）参加比赛。到底是什么把他们带到了这里，带到这块潮湿粘稠的微风持续吹拂的世界尽头。有一天，新来了一位牧师，但这位新牧师收到了来自他人的严厉指控。那个指控他的声音越来越响，直到它被一声枪响中断。年轻的牧师选择用自杀的方式来回避指控。上头派来了调查员，但这位调查员是不是真的希望查明事情的真相呢？也许他的出现只是希望继续维持着这里美丽的表象。 电影一点一点地将黑暗中的秘密揭示出来，挖掘了这些上帝仆人的过往，并无情地揭示了天主教堂里存在的许多矛盾。导演的剧本做到了教堂本身没有做到的事情，他并不是简单的惩罚一个替罪羊。影片实际上严格遵守了基督教中关于殉难的规则和仪式。◎获奖情况 第65届柏林国际电影节&nbsp; (2015) 银熊奖 评审团大奖 帕布罗&middot;拉雷恩 第73届金球奖&nbsp; (2016) 电影类 最佳外语片(提名) 第19届美国在线影评人协会奖&nbsp; (2015) 最佳非英语片(提名)', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9113/[阳光电影www.ygdy8.com].神父俱乐部.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160524/51043.html', 'http://pic.yupoo.com/tast0n/FwE3iIvP/uk5dz.jpg', 'http://i2.buimg.com/863b09f4f1badc46.jpg', '2016-06-25 15:40:12');
