INSERT INTO `blog_movie` VALUES ('1204', '局内人/寒流黑金(港)/内部者们/局内人们 导演剪辑版', 'Inside Men The Original', '2015', '韩国', '剧情/犯罪/动作', '韩语', '中文', '7.1/10 from 362 users', 'BD-RMVB', '1280 x 720', '1CD', '181分钟', '禹民镐 Min-ho Woo', '李秉宪 Byeng-hun Lee 曹承佑 Seung-woo Cho 白允植 Yun-shik Baek 李璟荣 Kyeong-yeong Lee 赵在允 Jae-yun Jo 裴成宇 Sung-Woo Bae 李艾 Elle Lee 金大明 Dae-Myung Kim 金弘波 Hong-Fa Kim', '电影《局内人》该片是一部犯罪动作片，通过保守派报纸评论员、国会议员、大企业委员、黑社会混混、情报科刑警、纪录片摄影家等人的经历，来揭露韩国社会的腐败和不正之风。李秉宪在片中饰演的安尚久一角原本是作为权利者的&ldquo;猎狗&rdquo;干尽坏事，但在自己成为废人之后，为了报仇而成为向着权利者开战的&ldquo;政治流氓&rdquo;。曹承佑饰演&quot;禹长勋检察官&quot;一角,是个在检察官组织中让踢人就踢人让掩盖罪行就掩盖罪行的腐败政治人的阻击手。白允植饰演的首都日报评论员李强熙。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9073/[阳光电影www.ygdy8.com].局内人.BD.720p.中文字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160616/51239.html', 'http://pic.yupoo.com/loongkee/FCnccRRc/4DOkd.jpg', 'http://i2.buimg.com/fcb973452c7a1598.jpg', '2016-06-25 15:40:12');
