INSERT INTO `blog_movie` VALUES ('1206', '老手/辣手警探(台)/燥底师兄生擒富二代(港)', 'Veteran', '2015', '韩国', '犯罪/动作/剧情', '韩语', '中文', '7.2/10 from 759 users', 'BD-RMVB', '1280 x 720', '1CD', '124分钟', '柳昇完 Seung-wan Ryoo', '黄政民 Jeong-min Hwang 饰 徐道哲 Seo Do-cheol 刘亚仁 Ah In Yoo 饰 赵泰晤 柳海真 Hye-jin Yu 饰 崔常务 吴达洙 Dal-su Oh 饰 吴队长 Team Leader Oh 郑万植 Man-shik Jeong 饰 所长 Manager Jeon 郑雄仁 Woong-in Jeong 饰 裴哲勇 Chauffeur Bae 张允珠 Jang Yoon-ju 饰 Miss奉 金时厚 Shi-hoo Kim 饰 尹刑警 Detective Yoon 陈庆', '广域搜查队的老手精英们各自都有擅长的领域，不过在新的一宗犯罪案中就让他们陷入困境，行动派调查组组长徐道哲（黄政民饰）直觉上认为幕后黑手正是财阀三世赵泰晤（刘亚仁饰），作为行动派刑警代表的徐道哲决定带领一支资深犯罪调查组与目中无人唯我独尊的赵泰晤正面交锋，双方展开了一场智勇博弈。◎幕后制作 拍摄过程 影片开篇的一场对战戏为了能在韩国最大规模的釜山港取景，制片组一早就向釜山港相关部门提交了详细的拍摄计划书，包括设备、工作人员、演员的详细路线。 片中徐道哲和赵泰晤的一场追击戏场面是在高层建筑物云集、市民聚集的首尔地标、最复杂最拥挤的街道明洞拍摄完成。影片从企划阶段就和各方相关部门沟通，获取拍摄许可和现场支持。柳承莞和黄正民还亲自到明洞管辖区的南大门警察局提出请求，使得韩国电影首次得以在明洞中心进行拍摄。拍摄时对明洞8条车道进行了全面的交通管制，用了四个晚上投入80多辆车拍摄完成。◎获奖情况 第6届豆瓣电影鑫像奖&nbsp; (2016) 鑫豆单元 最佳韩国电影(提名) 第2届豆瓣电影年度榜单&nbsp; (2015) 评分最高的韩国电影(提名)', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9089/[阳光电影www.ygdy8.com].老手.BD.720p.中文字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160416/50744.html', 'http://pic.yupoo.com/tast0n/Fs6r892h/mfZwS.jpg', 'http://i3.piimg.com/47791f78e822ffee.jpg', '2016-06-25 15:40:12');
