INSERT INTO `blog_movie` VALUES ('1208', '北极移民/北极熊诺姆(台)', 'Norm of the North', '2016', '印度/美国', '喜剧/动画/冒险', '英语', '中英双字幕', '3.6/10 from 3,044 users', 'BD-RMVB', '1280 x 692', '1CD', '90分钟', '特莱沃&middot;沃尔 Trevor Wall', '罗伯&middot;施奈德 Rob Schneider 海瑟&middot;格拉汉姆 Heather Graham 郑肯 Ken Jeong 科尔姆&middot;米尼 Colm Meaney 洛雷塔&middot;迪瓦恩 Loretta Devine 加布里埃尔&middot;伊格莱西亚斯 Gabriel Iglesias 迈克尔&middot;麦克埃尔哈顿 Michael McElhatton 比尔&middot;奈伊 Bill Nighy 杰斯&middot;哈梅尔 Jess Harnell 扎克瑞', '狮门电影公司（Lionsgate Films）将和印度的克斯特动画公司（Crest Animation）联手，拍摄3D动画片《北极移民》（Norm of the North）。本片将使用立体3D拍摄，这项技术在《阿凡达》中被采用过。 本片由斯蒂文&middot;奥迪尔（Steven Altiere）和丹尼尔&middot;奥迪尔（Daniel Altiere）编写剧本，故事集中于一头北极熊和三只旅鼠身上。当他们家乡的冰开始融化之后几只大小动物不得不向其他地方迁徙。后来在北极熊的带领下他们来到纽约，作为一家公司的吉祥物四处表演，最终发现自己的雇主其实就是北极冰雪融化的罪魁祸首。 本片被定位为家庭影片，由狮门家庭娱乐部门负责。克斯特动画公司希望在2012年年初让该片上映。 狮门电影公司的发言人称：&ldquo;通过各种各样的角色、场景以及旁白，《北极移民》将为全年龄的家庭观众提供相当不错的娱乐。&rdquo;克斯特动画公司的发言人补充说：&ldquo;这是一个充满幽默和真情的精彩故事，立体3D拍摄会让本片锦上添花。&rdquo;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9123/[阳光电影www.ygdy8.com].北极移民.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160607/51173.html', 'http://pic.yupoo.com/tast0n/FtanZRx4/BK6Qh.jpg', 'http://i4.buimg.com/26c46ef26318bb40.jpg', '2016-06-25 15:40:12');
