INSERT INTO `blog_movie` VALUES ('1221', '真相/真相急先锋(台)', 'Truth', '2015', '美国', '剧情/传记', '英语', '中英双字幕', '6.4/10 from 2,178 users', 'BD-RMVB', '1280 x 720', '1CD', '121分钟', '詹姆斯&middot;范德比尔特 James Vanderbilt', '凯特&middot;布兰切特 Cate Blanchett 罗伯特&middot;雷德福 Robert Redford 伊丽莎白&middot;莫斯 Elisabeth Moss 托弗&middot;戈瑞斯 Topher Grace 丹尼斯&middot;奎德 Dennis Quaid 布鲁斯&middot;格林伍德 Bruce Greenwood 大卫&middot;莱昂斯 David Lyons 约翰&middot;本杰明&middot;西基 John Benjamin Hickey 瑞切尔&midd', '身兼母亲双职的玛莉梅普斯（凯特布兰琪饰）是美国哥伦比亚广播公司（CBS）当红夜间新闻节目《60分钟》的王牌製作人，与CBS当家资深主播丹拉瑟（劳勃瑞福饰）两人合作无间，2004年9月，玛莉梅普斯意外接获线民密报一件关于总统的大丑闻，进而想尽各种办法调查证据及证人只为挖出真相。9月8日，玛莉在《60分钟》中製作了这则震惊全国的独家头条新闻，并由丹拉瑟亲自播报。消息一出立即造成轰动。 正值总统大选期间，如此争议性的独家新闻对选情影响深钜，寻求连任的总统候选人想尽办法抨击新闻报导裡文件证据的真实性，一方面指控玛莉梅普斯及丹拉瑟诈欺、伪造、播报假新闻，整个事件焦点随著其他媒体起糁�下渐渐被扭曲转移，甚至连玛莉的家人都被卷入其中，眼看局面一发不可收拾，被舆论打压甚至遭到生命威胁的玛莉，为了捍卫真相，即将赌上工作和人生信念的一切&hellip;◎关于电影 《真相急先锋》强势问鼎奥斯卡&nbsp; 凯特布兰琪二度封后呼声超高 &nbsp; &ldquo;年度最佳电影！&rdquo; --New York Observer 凯特布兰琪强势问鼎奥斯卡影后又一代表大作！拥有女王气势的凯特这次在《真相急先锋》裡挑战诠释新闻界传奇人物、CBS电视台王牌製作人玛莉梅普斯，亦刚亦柔演绎事业与家庭完美兼顾的超强职业母亲，在多伦多影展首映便搏得国际影评满堂彩，成为全球焦点，更被视为2016奥斯卡二度封后超级大热门，Screen International则大讚剧中男女主角的精湛演出，「凯特布兰琪、劳勃瑞福展现超高水准演技令人惊艳！」New York Observer更直呼《真相急先锋》为「年度最佳电影！」 60分钟爆料直击&nbsp; 21世纪新闻界最大丑闻&nbsp; 即刻转播头条对决 &ldquo;剧本与演员都完美到位的杰作！&rdquo; --TIME Magazine 《真相急先锋》改编自2004年轰动全球的真实丑闻桉件，2004年9月8日，美国哥伦比亚广播公司（CBS）当红夜间新闻节目《60分钟》播报了一则震惊全国的政治丑闻，报导中指出时任总统、即将于11月选举寻求连任的小布希在1968年时为了逃避越战，竟利用家族权势转调至国民兵部队，直到1974年期都在基地裡担任空军飞行员，却完全没有亲自上过战场，甚至人根本就没到基地执勤、训练。此消息一出便震惊全国，甚至被新闻媒体誉为「21世纪新闻界最大政治丑闻！」国际影评讚誉《真相急先锋》节奏紧凑得让人坐立难安，就像搭上云霄飞车一样，眼看着凯特布兰琪为了伸张正义而饱受有心人士攻击、挞伐，但她永不妥协坚持到底，让Time杂志专文大讚「剧本与演员都完美到位的杰作！」 《蜘蛛人：惊奇再起》、《白宫末日》好莱坞知名编剧首次执导 《真相急先锋》一鸣惊人&nbsp; 奥斯卡金奖梦幻卡司呕心沥血争议大作 「赤裸裸地揭穿电视台最不为人知的震撼真相」 曾为《索命黄道带》、《蜘蛛人：惊奇再起》及《白宫末日》等好莱坞卖座电影担任编剧的詹姆斯范德比尔特，首次执导处女作《真相急先锋》便一鸣惊人，在这部改编真实新闻事件的电影展现高超叙事手法，找来金奖影后凯特布兰琪及影帝劳勃瑞福携手演出，错增複杂的情节被詹姆斯编写后既极具戏剧性，又如行云流水般顺畅，旋即博得国际媒体一致好评。Variety则专文推荐「赤裸裸地揭穿电视台最不为人知的震撼真相！」气势问鼎明年奥斯卡最佳影片、导演、男女主角、改编剧本等多项大奖。 传奇人物饰演传奇人物&nbsp; 凯特布兰琪力挺新导演 &ldquo;独具前瞻性及悬疑的电影&rdquo; --New York Times  &ldquo;凯特布兰琪、劳勃瑞福展现超高水准演技令人惊艳！&rdquo; --Screen International 导演詹姆斯范德比尔特坦承一完成剧本以后，他心目中最完美的女主角人选就是凯特布兰琪，「这个角色只有她能演！」但詹姆斯万万没想到凯特布兰琪在读完剧本后居然主动联繫他讨论剧本细节，甚至还答应参与演出。「当时凯特布兰琪刚夺下奥斯卡影后，所有电影人都抢着跟她接洽，我只是个菜鸟导演，接到她电话时我真的既兴奋又害怕！」凯特布兰琪表示平时读剧本时都看很慢，甚至还会分好几次读完，但《真相急先锋》是第一本让她一坐下来就一口气全部读完的剧本，更深深被剧中女主角的坚忍自信所打动，遂即决定力挺新导演参与演出。 此外，剧中的知名新闻主播丹拉瑟，更是美国人心目中的传奇人物，像这样美国家喻户晓的名人，导演表示丹拉瑟有一种说不出来的权威感，让人发自内心地尊敬他，而要诠释这样的角色，「一定要由传奇人物饰演传奇人物！」导演经辗转介绍认识的曾获得奥斯卡最佳导演奖及终身成就奖的劳勃瑞福，成功邀请他加入《真相急先锋》阵容。更巧的是，劳勃瑞福在1970年代就曾与丹拉瑟本尊一起在电视台工作，也是多年老友，无疑是扮演丹拉瑟的最佳人选得奥斯卡最佳导演奖及终身成就奖的劳勃瑞福，成功邀请他加入《真相急先锋》阵容。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9046/[阳光电影www.ygdy8.com].真相.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160412/50713.html', 'http://pic.yupoo.com/hdarea/FgpP8iMR/DoS1.jpg', 'http://i4.piimg.com/d465a959fa5f563f.jpg', '2016-06-25 15:40:12');
