INSERT INTO `blog_movie` VALUES ('1229', '尊严殖民地/殖民尊严地/窒命地(台)', 'Colonia', '2015', '德国/卢森堡/法国', '剧情/历史/爱情/惊悚', '英语', '中英双字幕', '7.3/10 from 1,280 users', 'BD-RMVB', '1280 x 720', '1CD', '1h 49mn', '佛罗瑞&middot;加仑伯格 Florian Gallenberger', '艾玛&middot;沃森 Emma Watson  丹尼尔&middot;布鲁赫 Daniel Br&uuml;hl  迈克尔&middot;恩奎斯特 Michael Nyqvist  马丁&middot;乌特克 Martin Wuttke  薇姬&middot;克里普斯 Vicky Krieps  朱利安&middot;欧文登 Julian Ovenden  奥古斯特&middot;席纳 August Zirner  Richenda Carey  凯撒&middot;博尔东 Cesar Bordon ', '根据真实事件改编，影片聚焦1973年智利政变时期，一对年轻的德国夫妇丹尼尔与莱娜反抗智利军政 府统领、独裁者皮诺切特的故事。当时正值智利政变的高潮期，丹尼尔被皮诺切特的手下绑架到一个被称为&ldquo;尊严殖民地&rdquo;的秘密基地。那儿正是前德国纳粹分子逃亡智利所建的聚集地，而军政府武装进行着大量的刑讯工作与秘密人体实验，被绑架的人从来没有一个曾活着逃出&ldquo;殖民地&rdquo;。然而丹尼尔的妻子莱娜没有放弃，她找到了基地所在，并计划救出丈夫。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8092/[阳光电影www.ygdy8.com].尊严殖民地.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160421/50780.html', 'http://i2.piimg.com/196a2607a0e68983.jpg', 'http://i3.piimg.com/570a2b0189c6aaf9.jpg', '2016-06-25 15:40:12');
INSERT INTO `blog_movie` VALUES ('1230', '荒野猎人/复仇勇者(港)/神鬼猎人(台)/还魂者/亡魂/归来者', 'The Revenant', '2015', '美国', '剧情/惊悚/冒险', '英语/波尼语/法语', '中英双字幕', '8.2/10 from 291,249 users', 'BD-RMVB', '1280 x 720', '1CD', '156分钟', '亚利桑德罗&middot;冈萨雷斯&middot;伊纳里多 Alejandro Gonz&aacut', '莱昂纳多&middot;迪卡普里奥 Leonardo DiCaprio 饰 休&middot;格拉斯 Hugh Glass 汤姆&middot;哈迪 Tom Hardy 饰 约翰&middot;费兹杰罗 John Fitzgerald 多姆纳尔&middot;格利森 Domhnall Gleeson 饰 安德鲁&middot;亨利 Andrew Henry 威尔&middot;保尔特 Will Poulter 饰 吉姆&middot;柏瑞哲 Jim Bridger 福勒斯特&middot;古德勒克 For', '休&middot;格拉斯（莱昂纳多&middot;迪卡普里奥 Leonardo DiCaprio 饰）是一名皮草猎人，在一次打猎途中被一头熊殴打成重伤后被同行的乘船船长安德鲁&middot;亨利（多姆纳尔&middot;格里森 Domhnall Gleeson 饰）救下，船长雇佣了两个人约翰&middot;菲茨杰拉德（汤姆&middot;哈迪 Tom Hardy 饰）和吉姆&middot;布里杰（威尔&middot;保尔特 Will Poulter 饰）来照顾他。约翰&middot;菲茨杰拉德根本无心照顾格拉斯，一心只想着将格拉斯的财产占为己有，于是残忍的杀害了格拉斯的儿子，并说服吉姆&middot;布里杰将格拉斯抛弃在荒野等死。两人原以为格拉斯就会这样离世，但格拉斯凭借坚强的毅力在野性的蛮荒之地穿行了好几个月，终于回到了安全地带并开始了复仇计划。 影片根据迈克尔&middot;庞克同名长篇小说改编。◎获奖情况 第88届奥斯卡金像奖&nbsp; (2016) 最佳影片(提名) 史蒂夫&middot;戈林 / 玛丽&middot;帕伦特 / 基思&middot;雷德曼 / 亚利桑德罗&middot;冈萨雷斯&middot;伊纳里多 / 阿诺恩&middot;米尔坎 最佳导演 亚利桑德罗&middot;冈萨雷斯&middot;伊纳里多 最佳男主角 莱昂纳多&middot;迪卡普里奥 最佳男配角(提名) 汤姆&middot;哈迪 最佳摄影 艾曼努尔&middot;卢贝兹基  最佳剪辑(提名) 斯蒂芬&middot;米廖内 最佳视觉效果(提名) 麦特&middot;沙姆韦 / 理查德&middot;麦克布莱德 / 杰森&middot;史密斯 / 卡梅伦&middot;沃尔鲍尔 最佳音效剪辑(提名) 马丁&middot;埃尔南德斯 / 朗&middot;班德 最佳混音(提名) 兰迪&middot;汤姆 / 克里斯&middot;杜斯特迪克 / 乔恩&middot;泰勒 / 弗兰克&middot;A&middot;蒙塔诺 最佳美术指导(提名) 哈米什&middot;珀迪 / 杰克&middot;菲斯克 最佳服装设计(提名) 杰奎琳&middot;韦斯特 最佳化妆与发型设计(提名) 西安&middot;格里格 / 邓肯&middot;贾曼 / 罗伯特&middot;A&middot;潘蒂尼 第73届金球奖&nbsp; (2016) 电影类 最佳剧情片 电影类 剧情片最佳男主角 莱昂纳多&middot;迪卡普里奥 电影类 最佳导演 亚利桑德罗&middot;冈萨雷斯&middot;伊纳里多 电影类 最佳原创配乐(提名) 第69届英国电影学院奖&nbsp; (2016) 电影奖 最佳影片 电影奖 最佳导演 亚利桑德罗&middot;冈萨雷斯&middot;伊纳里多 电影奖 最佳男主角 莱昂纳多&middot;迪卡普里奥 电影奖 最佳摄影 电影奖 最佳剪辑(提名) 电影奖 最佳原创音乐(提名) 电影奖 最佳化妆/发型(提名) 电影奖 最佳音效 第43届动画安妮奖&nbsp; (2016) 最佳真人电影动画人物 第68届美国导演工会奖&nbsp; (2016) 最佳电影导演 亚利桑德罗&middot;冈萨雷斯&middot;伊纳里多 第22届美国演员工会奖&nbsp; (2016) 电影奖 最佳男主角 莱昂纳多&middot;迪卡普里奥 第27届美国制片人工会奖&nbsp; (2016) 最佳电影制片人奖(提名) 第30