INSERT INTO `blog_movie` VALUES ('1233', '怒海救援/绝命救援(台)/危情救援/最美的时光', 'The Finest Hours', '2016', '美国', '剧情/动作/惊悚', '英语', '中英双字幕', '7.1/10 from 6,898 users', 'BD-RMVB', '1280 x 720', '1CD', '117分钟', '克雷格&middot;吉勒斯佩 Craig Gillespie', '克里斯&middot;派恩 Chris Pine  卡西&middot;阿弗莱克 Casey Affleck  本&middot;福斯特 Ben Foster  艾瑞克&middot;巴纳 Eric Bana  荷丽黛&middot;格兰杰 Holliday Grainger  约翰&middot;奥提兹 John Ortiz  乔什&middot;斯图沃特 Josh Stewart  格拉汉姆&middot;麦克泰维什 Graham McTavish  凯尔&middot;加尔纳 Kyle Gallne', '&nbsp;  影片根据真实事件改编，讲述海岸警卫队在暴风雪后，营救被困油轮船员的故事。 一艘名为SS Pendleton油轮在开往波士顿的航程中因风暴抛锚，船只开始渗水并有沉没的风险，而船上30位水手的命运危在旦夕。雷&middot;希伯特（卡西&middot;阿弗莱克饰）作为当时船上职位最高的工作人员开始组织众人自救，与此同时，马萨诸塞州海岸警卫队派出了救援队开始海上搜救。在队长伯尼&middot;韦伯（克里斯&middot;派恩饰）的带领下，四名警卫队成员开着一艘发动机都坏掉的木质救生船出发，等待他们的将是一场面对海浪的殊死搏斗。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8076/[阳光电影www.ygdy8.com].怒海救援.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160513/50972.html', 'http://pic.yupoo.com/tast0n/FxqTtuhX/x9CQy.jpg', 'http://i2.buimg.com/b6880ede71b8e577.jpg', '2016-06-25 15:40:12');
INSERT INTO `blog_movie` VALUES ('1234', '神战：权力之眼/埃及神戰港)/荷魯斯之眼：王者爭霸(台)', 'Gods of Egypt', '2016', '美国/澳大利亚', '动作/奇幻/冒险', '英语', '中英双字幕', '5.6/10 from 18,574 users', 'BD-RMVB', '1280 x 720', '1CD', '127分钟', '亚历克斯&middot;普罗亚斯 Alex Proyas', '尼古拉&middot;科斯特-瓦尔道 Nikolaj Coster-Waldau 饰 荷鲁斯（Horus） 布伦顿&middot;思韦茨 Brenton Thwaites 饰 贝克（Bek）  杰拉德&middot;巴特勒 Gerard Butler 饰 赛特（Set） 查德维克&middot;博斯曼 Chadwick Boseman 饰 托特（Thoth） 艾洛蒂&middot;袁 Elodie Yung 饰 哈索尔（Hathor） 考特尼&middot;伊顿 Courtney Eaton 饰 莎雅（Z', '故事发生在矗立着宫殿和金字塔的婉转萦回的尼罗河畔。当时的古埃及充满了魔法、怪兽和神灵。无情的黑暗之神赛特,夺取了原本属于天神荷鲁斯的埃及王权,并让曾经繁荣和平的国家陷入冲突与混乱。人类的存亡与世界的安定岌岌可危。 一位年轻的窃贼贝克被神所眷顾,为拯救世界和自己的真爱踏上了一场惊险的奇幻旅程。为了成功,他必须寻求并得到强大的荷鲁斯神的帮助,与其组成一个看似不太可能的&ldquo;英雄&rdquo; 联盟。随着人类生命的危在旦夕,两个英雄站了出来,开启了对抗邪恶的不归路&hellip;&hellip;作为荷鲁斯与贝克强有力的敌人,赛特指派心腹为他们的对抗制造重重艰难险阻。如果荷鲁斯神与凡人贝克希望在这场对抗中最终获胜,他们就必须通过一系列对勇气和牺牲的考验。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9109/[阳光电影www.ygdy8.com].神战：权力之眼.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160519/51013.html', 'http://pic.yupoo.com/tast0n/FyuFLkOY/HMw5O.jpg', 'http://i2.buimg.com/0bde03816d36709a.jpg', '2016-06-25 15:40:12');
INSERT INTO `blog_movie` VALUES ('1235', '病毒入侵', 'Pandemic/Viral', '2015', '美国', '动作/科幻', '英语', '中英双字幕', '5.2/10 from 2,466 users', 'BD-RMVB', '1280 x 720', '1CD', '91分钟', 'John Suits', '阿尔菲&middot;艾伦 Alfie Allen 瑞秋&middot;尼科尔斯 Rachel Nichols 米西&middot;派勒 Missi Pyle 梅奇&middot;费法 Mekhi Phifer 丹妮尔&middot;罗丝&middot;拉塞尔 Danielle Rose Russell 保罗&middot;吉尔福伊尔 Paul Guilfoyle 多米尼克&middot;博加特 Dominic Bogart 阿曼达&middot;贝克 Amanda Baker Robert Lewis ', '在不久的将来，一种史无前例的超级病毒席卷全球，感染的人数远超过未感染的幸存者，人类处于灭绝的边缘，生存下来的唯一希望是寻找治愈病毒的疫苗，医生劳伦受命带领一支小队来到洛杉矶寻找一线生机并拯救未受感染的幸存者。 近未来，神秘的菲拉病毒肆意蔓延，感染者免疫力下降，经历几个发病阶段后会变得极为疯狂。他们会攻击其他人，而被感染者也很快会转化为丧失人性的攻击者，国际大都会纽约就此沦陷。这一日，前医生劳伦&middot;蔡斯（瑞秋&middot;尼科尔斯 Rachel Nichols 饰）受命前往一个补给站去取回89个菲拉病毒的血样，并寻找幸存者。这次征程凶险非常，稍不留神就会死于非命。小分队刚刚驶出隔离区，就遭到大批感染者的袭击。经过血腥的对抗，他们总算完好无缺冲出重围。  然而这一路险象环生，并且计划发生了变更，谁也不知道自己的命运将会如何&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9098/[阳光电影www.ygdy8.com].病毒入侵.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160429/50833.html', 'http://i4.piimg.com/4cc6a88ca2b828f0.jpg', 'http://i2.piimg.com/8fe491a8d5fbd1a7.jpg', '2016-06-25 15:40:12');
INSERT INTO `blog_movie` VALUES ('1236', '冰雪女王/冰雪皇后/雪之女王', 'Snezhnaya koroleva / The Snow Queen', '2015-08-03', '俄罗斯', '动画/奇幻', '普通话', '无字幕', '5.3/10 from 1,089 users', 'HD-RMVB', '1280 x 720', '1CD', '1h 15mn', 'Vlad Barbe / Maksim Sveshnikov / Vladlen Barbe', '刘纯燕 Chunyan Liu 格尔达(中文版配音)  霍尊 Henry Huo 凯(中文版配音)  金炜 Wei Jin 奥姆(中文版配音)  辛迪&middot;罗宾逊 Cindy Robinson 冰雪女王 Snow Queen / Robber Hag (voice)  伊万&middot;奥克洛布斯汀 Ivan Okhlobystin 奥姆 Orm (voice)  杰西卡&middot;斯特劳斯 Jessica Straus 格尔达 Gerda (voice)  莱米莉亚&middot;伊斯坎', '邪恶的冰雪女王（辛迪&middot;罗宾逊 Cindy Robinson 配音）最痛恨什么？毫无疑问是艺术！艺术能够使人的心灵变得敏感而柔软，这简直和冰雪女王心目中的完美世界大相径庭，于是，冰雪女王施下了魔法，使人类的心灵永恒冻结，使艺术家们彻底消失。冰雪女王成为了全世界魔法师们共同的敌人。  然而，冰雪女王实在是太强大了，很快，世界上所有的魔法使都死在了她的手中，只留下格尔达（杰西卡&middot;斯特劳斯 Jessica Straus 配音）和凯（莱米莉亚&middot;伊斯坎德尔 Ramilya Iskander 饰）这对尚且年幼的姐弟。随着时间的推移，两人渐渐长大，冰雪女王发现了他们的存在，派出了爪牙奥姆（伊万&middot;奥克洛布斯汀 Ivan Okhlobystin 配音），发誓要将两人赶尽杀绝。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9058/[阳光电影www.ygdy8.com].冰雪女王.HD.720p.国语.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160519/51011.html', 'http://i2.piimg.com/674c689068584c16.jpg', 'http://i4.piimg.com/c2d4094af42ea15f.jpg', '2016-06-25 15:40:12');
