INSERT INTO `blog_movie` VALUES ('1244', '安德烈：黑色的迷宫', 'Andr&ograve;n: The Black Labyrinth', '2015', '意大利', '动作/科幻', '英语', '中英双字幕', '5.5/10 from 57 users', 'BD-RMVB', '1280 x 720', '1CD', '1h 36mn', 'Francesco Cinquemani', '葛尔&middot;哈罗德 Gale Harold 亚历克&middot;鲍德温 Alec Baldwin 米歇尔&middot;雷恩 Michelle Ryan 里奥&middot;霍华德 Leo Howard 安东尼娅&middot;坎贝尔&middot;休斯 Antonia Campbell-Hughes Skin Skinny 乔&middot;科塔加伦那 Jon Kortajarena Korlan Mad Mauro Conte Alex Martin Gaia Scodellaro Elet', '讲述了一群囚犯发现自己被困在一个神秘而致命的迷宫里，此迷宫名为&ldquo;安德烈（Andr&ograve;n）&rdquo;。他们不记得他们为何来到了这里，甚至不记得他们的名字。于是他们决意去探索背后的奥秘，寻求答案。经历一个个关卡，破解各式密码。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8119/[阳光电影www.ygdy8.com].安德烈：黑色的迷宫.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160607/51174.html', 'http://i1.buimg.com/2fa69a4ed82a333d.jpg', 'http://i4.buimg.com/36a960a30e268155.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1245', '1和2/单与双/一和二', 'One and Two', '2015', '美国', '剧情/奇幻/惊悚', '英语', '中英双字幕', '5.3/10 from 488 users', 'BD-RMVB', '1280 x 720', '1CD', '90 Mins', 'Andrew Droz Palermo', '琪兰&middot;席普卡 Kiernan Shipka ....Eva Timoth&eacute;e Chalamet ....Zac Elizabeth Reaser ....Elizabeth Grant Bowler ....Daniel Rest of cast listed alphabetically:  Wendy Ahlstrom ....Country Woman Kyle Bell ....Jeff Zachary Dylan Brown ....Nurse Chantey Col', '有一户人家，他们世代隐居在由高墙和篱笆围起的一方天地里。与世隔绝的他们不论外界的时代如何更替，文明怎样进展，仍然固守着古老的生活方式，简朴、素雅、纯真。有时候，丰沛的阳光会穿过茂密的守护森林，毫无保留地照耀着每一棵古树、每一寸厚土，也照耀着光影里两个精灵般嬉戏时而消失又突然显现的 少年。 成长的路总不是一片坦途，正如叛逆的阵痛永远会如期而至。眼看着新鲜力量就要冲破这亘古的高墙和藩篱，然而母亲的离奇暴毙，妹妹的突然失踪，父亲愈发的心事重重，都令少年更加坚信自己身处在一个古老而危险的秘密之中，而这个秘密的答案，也许就能解开羁绊在自己和妹妹身上的神秘力量的终极谜题&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9056/[阳光电影www.ygdy8.com].1和2.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160506/50906.html', 'http://i4.tietuku.cn/bef030219fc8901e.jpg', 'http://i8.tietuku.cn/6911ba02ef37764e.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1246', '最后的德鲁伊：加尔姆战争', 'Garm Wars: The Last Druid', '2014', '加拿大/日本', '动作/科幻', '英语', '中英双字幕', '&nbsp; 4.9/10 from 237 users', 'BD-RMVB', '1280 x 720', '1CD', '92分钟◎上映日期 2014-10-25(东京国际电影节)/2016-05-20(日本)', '押井守 Mamoru Oshii', 'Lance Henriksen ....Wydd&nbsp;  Kevin Durand ....Skellig&nbsp;  M&eacute;lanie St-Pierre ....Khara&nbsp;  Summer H. Howell ....Nascien&nbsp;  Dawn Ford ....The Commander&nbsp;  Andrew Gillies ....Interrogator A&nbsp;  Jordan Van Dyck ....Interrogator B&nb', '本片讲述在遥远的古代，一颗常年发生战争的星球上的故事。创世主和他的GARM战士们以及他们视作神圣的狗古拉，还有鸟生活在这里。GARM在肉体覆灭之后可以通过转移个体记忆的方法生生不息。在创世主离开星球之后，三个部族为了争夺霸权展开战斗。一天，从天而降的科伦巴部族女飞行员卡拉，在与地面部族布利嘉的士兵战斗时，和操作情报的部酷木塔库的老人韦德相遇。我们到底来自何方要去何处？韦德提出的不可思议的问题，让敌我双方都产生了奇妙的联系。三人为了寻找GARM的真相展开冒险之旅。但这其实是触怒神灵的行为。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8077/[阳光电影www.ygdy8.com].最后的德鲁伊：加尔姆战争.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160514/50980.html', 'http://i3.buimg.com/2b9d7632a047afd9.jpg', 'http://i3.buimg.com/96887aed39667577.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1247', '凯撒万岁/凯萨万岁(台)/万千星辉绑架案(港)/致敬恺撒', 'Hail, Caesar!', '2016', '英国/美国', '剧情/喜剧/悬疑/歌舞', '英语', '中文', '6.7/10 from 30,550 users', 'HD-RMVB', '1280 x 696', '1CD', '106分钟', '伊桑&middot;科恩 Ethan Coen 乔尔&middot;科恩 Joel Coen', '乔什&middot;布洛林 Josh Brolin  乔治&middot;克鲁尼 George Clooney  阿尔登&middot;埃伦瑞奇 Alden Ehrenreich  拉尔夫&middot;费因斯 Ralph Fiennes  乔纳&middot;希尔 Jonah Hill  斯嘉丽&middot;约翰逊 Scarlett Johansson  弗兰西斯&middot;麦克多蒙德 Frances McDormand  蒂尔达&middot;斯文顿 Tilda Swinton  查宁&midd', '大片厂的危机公关高手艾迪（乔什&middot;布洛林），应付麻烦不断的《凯撒万岁：基督的一生》剧组。酗酒主演贝尔德（乔治&middot;克鲁尼）遭苏联人绑架。导演劳伦斯（拉尔夫&middot;费恩斯）令女星（斯嘉丽&middot;约翰逊）意外怀孕，八卦专栏作家（蒂尔达&middot;斯文顿）虎视眈眈，鲜肉演员查宁&middot;塔图姆和阿尔登&middot;埃伦瑞奇也不是省油的灯。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9093/[阳光电影www.ygdy8.com].凯撒万岁.HD.720p.英语中字.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160420/50773.html', 'http://i4.piimg.com/bcbc889aba288af4.jpg', 'http://i2.piimg.com/9fcd2b2673ee8b9e.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1248', '彗星来的那一夜/相干性/相干效应', 'Coherence', '2013', '美国/英国', '科幻/悬疑/惊悚', '英语', '中英双字幕', '7.1/10 from 30,110 users', 'BD-RMVB', '1280 x 720', '1CD', '89分钟', '詹姆斯&middot;沃德&middot;布柯特 James Ward Byrkit', '艾米丽&middot;芭尔多尼 Emily Baldoni 饰 Em (as Emily Foxler) 莫瑞&middot;史特林 Maury Sterling 饰 Kevin 尼古拉斯&middot;布兰登 Nicholas Brendon 饰 Mike 伊丽莎白&middot;格瑞斯 Elizabeth Gracen 饰 Beth 亚历克斯&middot;马努吉安 Alex Manugian 饰 Amir 劳伦&middot;马赫 Lauren Maher 饰 Laurie 雨果&middot;阿姆', '在一个静得有些诡异阴森的夜晚，年轻女子艾米丽（艾米丽&middot;芭尔多尼饰）驱车来到朋友家参加聚会。此前她一边开车一边和男友打电话，然而通话突然中断，她的手机屏也莫名其妙出现裂痕。  这一事件让艾米丽的心中升起隐隐不安，因为当晚一颗彗星刚好接近地球，一个很久之前听过的传说使她对彗星的到来有着不祥的预感。稍后，朋友们落座，大家彼此交谈，叙说近况，虽然言语中有着许多莫名其妙、蹊跷反常的线索，然而均被一带而过。突然间，灯光尽灭。当光明重新来临时，众人发现附近只有一户人家还在亮灯，而亮灯人家里坐着的竟是他们自己&hellip;&hellip;◎获奖情况 第5届豆瓣电影鑫像奖 (2015) 鑫豆单元 最佳影片(外语)(提名)', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8061/[阳光电影www.ygdy8.com].彗星来的那一夜.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160425/50804.html', 'http://pic.yupoo.com/tast0n/EEmkXrGQ/5dTsI.jpg', 'http://i4.tietuku.cn/949338082fcd5dbc.jpg', '2016-06-25 15:40:13');
