INSERT INTO `blog_movie` VALUES ('1250', '第五波/第五毁灭(台)/第五天劫(港)', 'The 5th Wave', '2016', '美国', '动作/科幻/惊悚/冒险', '英语', '中英双字幕', '5.3/10 from 24,784 users', 'BD-RMVB', '1280 x 720', '1CD', '112分钟', 'J 布莱克森 J Blakeson', '科洛&middot;莫瑞兹 Chlo? Moretz  尼克&middot;罗宾森 Nick Robinson  朗&middot;里维斯顿 Ron Livingston  玛姬&middot;丝弗 Maggie Siff  亚历克斯&middot;罗伊 Alex Roe  玛丽亚&middot;贝罗 Maria Bello  麦卡&middot;梦露 Maika Monroe  列维&middot;施瑞博尔 Liev Schreiber  扎克瑞&middot;亚瑟 Zackary Arthur  托尼', '本片是长大后的&ldquo;小魔女&rdquo;科洛&middot;格蕾斯&middot;莫瑞兹的末世题材的科幻大片，影片改编自瑞克&middot;杨西的同名畅销小说，作者用三部曲描绘了一个遭外来物种入侵的世界，《第五波》是它的第一部。故事讲述地球遭到外星人攻击，人类文明退回石器时代，16岁少女凯西作为仅存人类之一，挣扎生存，寻找希望。  外星人入侵先后展开四番攻击，欲将人类赶尽杀绝！第一：黑暗(Darkness)，第二：大规模破坏(Destruction)；第三：传染病(Infection)；第四：侵略(Invasion)：不受病毒感染的人类会遭寄生体控制意识袭击其他人类。避过四番攻击的幸存者Cassie Sullivan ，誓要用尽一切方法找寻失联的弟弟。外星人准备发动第五波攻击，但仅存下来的人类之间信任亦濒临崩解&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8090/[阳光电影www.ygdy8.com].第五波.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160416/50745.html', 'http://i4.tietuku.cn/749a3dd094456a61.jpg', 'http://i3.piimg.com/4957ab75562035b5.jpg', '2016-06-25 15:40:13');
