INSERT INTO `blog_movie` VALUES ('1252', '我的特工爷爷/老卫兵', 'My Beloved Bodyguard', '2016', '中国香港/中国', '剧情/动作/冒险', '普通话', '中英双字', '6.3/10 from 99 users', 'HD-MKV', '1280 x 720', '1CD', '97分钟', '洪金宝 Sammo Hung Kam-Bo', '洪金宝 Sammo Hung Kam-Bo  刘德华 Andy Lau  朱雨辰 Yuchen Zhu  李勤勤 Qinqin Li  冯嘉怡 Jiayi Feng  陈沛妍 Jacqueline Chan  胡军 Jun Hu  冯绍峰 Shaofeng Feng  彭于晏 Eddie Peng &nbsp;', '退休军官老丁（洪金宝 饰）因&ldquo;健忘症&rdquo;弄丢孙女，内疚回到老家。邻居小女孩春花（陈沛妍 饰）成为他的慰藉。可女孩的父亲（刘德华 饰）无意卷入了当地黑帮团伙的争斗中。老丁为营救春花挺身而出，也寻回那份作为军人的骄傲和弥补作为爷爷的过错。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9054/[阳光电影www.ygdy8.com].我的特工爷爷.BD.720p.国语中字.mkv', 'http://www.dytt8.net/html/gndy/dyzz/20160501/50844.html', 'http://www.xingyule.com/Uploads/image/20150608/20150608034051_92298.jpg', 'http://i2.piimg.com/afcbb8dfe09152e3.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1253', '致命录像带3：病毒', '&nbsp; V/H/S Viral', '2014', '美国', '惊悚/恐怖', '英语', '中文', '4.2/10 10,066 votes', 'BD-RMVB', '1280 x 720', '1CD', '1h 35mn', '那奇欧&middot;维加隆多 Nacho Vigalondo 马希尔&middot;萨门多 Mar', 'Carrie Keagan ustin Welborn Jessica Luza Randy McDowell Emilia Zoryan Emmy Argo Michael Aaron Milligan', '1）魔术师但丁依靠神秘的斗篷在时尚都会挣下超高的人气，但是斗篷中藏着可怕的秘密，但丁则用录像记录下了一切。直到某天助理斯卡莉特将录像带交给警方，一切昭然若揭；2）野生科学家阿方索制造了一个连通平行空间的大门，他和另一个世界的自己交换空间，到对方的世界进行15分钟的探险，却发现彼此的世界有着天壤之别。3）三个热衷做极限运动的年轻人偶然来到一处画着神秘图案的场所玩耍，不知不觉中遭到一群恐怖之人的包围和袭击；夜幕下的城市突然响起刺耳的警笛声，警方和疯狂逃跑的冰淇淋车展开夺命追逐。卡文和女友艾瑞丝外出张望，谁知一转眼艾瑞丝竟消失不见，卡文疯了一般四下寻找。  现代化的社会，人们依赖影像大刷存在感，却都变成了转瞬即逝的数据碎片&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8097/[阳光电影www.ygdy8.com].恐怖录像带3.BD.720p.中文字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160615/51233.html', 'http://pic.yupoo.com/qzone3000156686/EwYBL5Cq/KeHch.jpg', 'http://i13.tietuku.cn/e6438645ca335898.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1254', '马龙，听我说', 'Listen to Me Marlon', '2015', '英国', '传记/纪录片', '英语', '中英双字幕', '8.2/10 from 3,392 users', 'BD-RMVB', '1280 x 720', '1CD', '95分钟', 'Stevan Riley', '马龙&middot;白兰度 Marlon Brando', '这部纪录片由马龙&middot;白兰度自己录制的视频和音频构成，通过他的音容笑貌去了解他伟大的演艺生涯，以及远离尘嚣的私人生活。 With exclusive access to his extraordinary unseen and unheard personal archive including hundreds of hours of audio recorded over the course of his life, this is the definitive Marlon Brando cinema documentary. Charting his exceptional career as an actor and his extraordinary life away from the stage and screen with Brando himself as your guide, the film will fully explore the complexities of the man by telling the story uniquely from Marlon\'s perspective, entirely in his own voice. No talking heads, no interviewees, just Brando on Brando and life.', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9052/[阳光电影www.ygdy8.com].马龙，听我说.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160424/50796.html', 'http://pic.yupoo.com/tast0n/F6OLZYkh/WMylW.jpg', 'http://i4.tietuku.cn/dc4dc8db25119cf3.jpg', '2016-06-25 15:40:13');
