INSERT INTO `blog_movie` VALUES ('1257', '震荡效应/震荡真相(港)/脑震荡', 'Concussion', '2015', '英国/澳大利亚/美国', '剧情/传记/运动', '英语', '中英双字幕', '7.1/10 from 20,869 users', 'BD-RMVB', '1280 x 720', '1CD', '123分钟', '彼得&middot;兰德斯曼 Peter Landesman', '威尔&middot;史密斯 Will Smith  亚历克&middot;鲍德温 Alec Baldwin  古古&middot;姆巴塔-劳 Gugu Mbatha-Raw  艾利斯&middot;霍华德 Arliss Howard  卢克&middot;威尔逊 Luke Wilson  保罗&middot;雷瑟 Paul Reiser  阿德沃尔&middot;阿吉纽依-艾格拜吉 Adewale Akinnuoye-Agbaje  大卫&middot;摩斯 David Morse  艾伯特&middot', '改编自珍妮&middot;玛丽&middot;拉斯卡斯于2009年在《GQ》上发表的文章《Game Brain》。电影主要描述脑神经学医生班奈特&middot;奥玛鲁最先发现到运动员容易罹患一种慢性创伤性脑病（CTE），会使该运动员产生自杀念头。  故事改编自真实事件，叙述班奈特&middot;奥玛鲁是一名美国脑神经学医生，他是首位发现美式橄榄球员高概率会因职业缘故而造成脑部慢性病变，便决定将此研究公诸于世。但此研究却遭国家美式橄榄球联盟强烈否认，使得班奈特将面临对事业造成强烈冲击的危机。 ◎获奖情况  第73届金球奖 (2016)  电影类 剧情片最佳男主角(提名) 威尔&middot;史密斯', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8087/[阳光电影www.ygdy8.com].震荡效应.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160412/50714.html', 'http://pic.yupoo.com/hdarea/FotaAbuL/OjHJU.jpg', 'http://i3.piimg.com/a1f4771d156e325c.jpg', '2016-06-25 15:40:13');
