INSERT INTO `blog_movie` VALUES ('1259', '疯狂动物城/优兽大都会(港)/动物方城市(台)/动物乌托邦/动物大都会', 'Zootopia', '2016', '美国', '喜剧/动作/动画/冒险', '国语', '中文', '8.3/10 from 76,004 users', 'HD-RMVB', '1280 x 720', '1CD', '109分钟', '拜伦&middot;霍华德 Byron Howard / 瑞奇&middot;摩尔 Rich Moo', '金妮弗&middot;古德温 Ginnifer Goodwin 杰森&middot;贝特曼 Jason Bateman 伊德里斯&middot;艾尔巴 Idris Elba 珍妮&middot;斯蕾特 Jenny Slate 内特&middot;托伦斯 Nate Torrence 邦尼&middot;亨特 Bonnie Hunt 唐&middot;雷克 Don Lake 汤米&middot;钟 Tommy Chong J&middot;K&middot;西蒙斯 J.K. Simmons 奥克塔维亚&mid', '故事发生在一个所有哺乳类动物和谐共存的美好世界中，兔子朱迪（金妮弗&middot;古德温 Ginnifer Goodwin 配音）从小就梦想着能够成为一名惩恶扬善的刑警，凭借着智慧和努力，朱迪成功的从警校中毕业进入了疯狂动物城警察局，殊不知这里是大型肉食类动物的领地，作为第一只，也是唯一的小型食草类动物，朱迪会遇到怎样的故事呢？ 近日里，城中接连发生动物失踪案件，就在全部警员都致力于调查案件真相之时，朱迪却被局长（伊德瑞斯&middot;艾尔巴 Idris Elba 配音）发配成为了一名无足轻重的交警。某日，正在执勤的兔子遇见了名为尼克（杰森&middot;贝特曼 Jason Bateman 配音）的狐狸，两人不打不相识，之后又误打误撞的接受了寻找失踪的水獭先生的任务，如果不能在两天之内找到水獭先生，朱迪就必须自愿离开警局。朱迪找到了尼克，两人联手揭露了一个隐藏在疯狂动物城之中的惊天秘密。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8108/[阳光电影www.ygdy8.com].疯狂动物城.HD.720p.国语中字.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160518/51006.html', 'http://i3.buimg.com/9d3f2c605e3a591a.jpg', 'http://i2.buimg.com/385aca31ddc00d2a.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1260', '记住/我记得(台)', 'Remember', '2015', '加拿大/德国', '剧情/惊悚', '英语/德语', '中英双字幕', '7.3/10 from 3,290 users', 'BD-RMVB', '1280 x 720', '1CD', '99 Mins', '阿托姆&middot;伊戈扬&nbsp; Atom Egoyan', '克里斯托弗&middot;普卢默&nbsp; Christopher Plummer ....Zev Gutman 迪恩&middot;诺里斯&nbsp; Dean Norris ....John Kurlander 马丁&middot;兰道&nbsp; Martin Landau ....Max Rosenbaum 亨利&middot;科泽尼&nbsp; Henry Czerny ....Charles Gutman 尤尔根&middot;普洛斯诺&nbsp; J&uuml;rgen Prochnow ', '奥斯卡男配角克里斯多夫普拉玛主演，他以精湛的演技，诠释一位患有阿兹海默症的二战屠杀生还者，必须在完全丧失记忆前，找到当年陷害他全家的刽子手，以完成复仇任务。在令人胆颤心惊的悬疑气氛下，真相也逐渐从记忆迷雾中浮现。&nbsp; &nbsp; Zev背负着一个使命：为自己的家人报仇，他们在70年前被一名纳粹杀害，而这个凶手现在隐姓埋名生活在美国。◎获奖情况第72届威尼斯电影节&nbsp; (2015)金狮奖(提名)', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8055/[阳光电影www.ygdy8.com].记住.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160415/50736.html', 'http://i3.piimg.com/381e01f6614082b9.jpg', 'http://i4.piimg.com/46f54051897dbaf6.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1261', '女巫', 'The VVitch: A New-England Folktale', '2015', '美国/英国/加拿大/巴西', '悬疑/恐怖', '英语', '中英双字幕', '7.1/10 from 27,690 users', 'BD-RMVB', '1280 x 772', '1CD', '92分钟', '罗伯特&middot;艾格斯 Robert Eggers', '安雅&middot;泰勒-乔伊 Anya Taylor-Joy 拉尔夫&middot;尹爱森 Ralph Ineson 凯特&middot;迪基 Kate Dickie 哈维&middot;斯克林肖 Harvey Scrimshaw 艾丽&middot;格兰杰 Ellie Grainger 卢卡斯&middot;道森 Lucas Dawson 朱利安&middot;瑞钦斯 Julian Richings 芭丝谢芭&middot;加内特 Bathsheba Garnett 莎拉&middot;史蒂文森 Sa', '故事发生在16世纪30年代的新英格兰，由于无法苟同教会的做法，虔诚的清教徒威廉（拉尔夫&middot;尹爱森 Ralph Ineson 饰）遭到种植园的驱逐，被迫带着妻子凯瑟琳（凯特&middot;迪基 Kate Dickie 饰）和一众儿女远迁来到一处荒芜所在。他们白手起家，历经艰辛，而尚在襁褓中的儿子意外失踪则令一家人的心头蒙上挥之不去的阴影。天气恶劣，作物歉收，夫妻二人的关系陷入紧张，凯瑟琳心念下落不明的孩子，精神近于崩溃。在此期间，自感对孩子失踪负有主要责任的长女托马辛（安雅&middot;泰勒-乔伊 Anya Taylor-Joy 饰）心情沉重，此后不久，大弟凯勒布（哈维&middot;斯克林肖 Harvey Scrimshaw 饰）在丛林深处遭遇女巫，心智错乱。 一家人的生活彻底陷入混乱，他们能否在信仰中得到救赎？', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8101/[阳光电影www.ygdy8.com].女巫.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160508/50927.html', 'http://pic.yupoo.com/tast0n/FwPsRQE9/P1WSA.jpg', 'http://i2.buimg.com/e2d41f3b324e75b1.jpg', '2016-06-25 15:40:13');
