INSERT INTO `blog_movie` VALUES ('1264', '怒海救援/绝命救援(台)/危情救援/最美的时光', 'The Finest Hours', '2016', '美国', '剧情/动作/惊悚', '英语', '中文', '7.1/10 from 6,898 users', 'HD-RMVB', '1280 x 720', '1CD', '117分钟', '克雷格&middot;吉勒斯佩 Craig Gillespie', '克里斯&middot;派恩 Chris Pine  卡西&middot;阿弗莱克 Casey Affleck  本&middot;福斯特 Ben Foster  艾瑞克&middot;巴纳 Eric Bana  荷丽黛&middot;格兰杰 Holliday Grainger  约翰&middot;奥提兹 John Ortiz  乔什&middot;斯图沃特 Josh Stewart  格拉汉姆&middot;麦克泰维什 Graham McTavish  凯尔&middot;加尔纳 Kyle Gallne', '&nbsp;  影片根据真实事件改编，讲述海岸警卫队在暴风雪后，营救被困油轮船员的故事。 一艘名为SS Pendleton油轮在开往波士顿的航程中因风暴抛锚，船只开始渗水并有沉没的风险，而船上30位水手的命运危在旦夕。雷&middot;希伯特（卡西&middot;阿弗莱克饰）作为当时船上职位最高的工作人员开始组织众人自救，与此同时，马萨诸塞州海岸警卫队派出了救援队开始海上搜救。在队长伯尼&middot;韦伯（克里斯&middot;派恩饰）的带领下，四名警卫队成员开着一艘发动机都坏掉的木质救生船出发，等待他们的将是一场面对海浪的殊死搏斗。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:8070/[阳光电影www.ygdy8.com].怒海救援.HD.720p.中文字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160508/50917.html', 'http://i4.buimg.com/dd6fc9f18afc520e.jpg', 'http://i4.buimg.com/ba98428e325121ea.jpg', '2016-06-25 15:40:13');
