INSERT INTO `blog_movie` VALUES ('1266', '地狱之门：耶路撒冷/圣域：耶路撒冷(台)', 'JeruZalem', '2016', '以色列', '恐怖', '英语', '中英双字幕', '4.8/10 from 941 users', 'BD-RMVB', '1280 x 720', '1CD', '94分钟', 'Doron Paz / Yoav Paz', '耶尔&middot;格洛格拉斯 Yael Grobglas ....Rachel Klein&nbsp;  Yon Tumarkin ....Kevin Reed&nbsp;  Danielle Jadelyn ....Sarah Pullman&nbsp;  Tom Graziani ....Omar&nbsp;  Sarel Piterman ....Young Priest&nbsp;  Howard Rypp ....Howard Pullman&nbsp;  Ami Smolartchik ..', '在过去的一年里，青春靓丽的女孩莎拉&middot;帕尔曼（Danielle Jadelyn 饰）经历了有生以来最为难熬的一刻。为了让她开心，父亲给她买了智能眼镜。在此期间，好友瑞秋&middot;克莱恩（耶尔&middot;格洛格拉斯 Yael Grobglas 饰）约她一同前往以色列第二大城市特拉维夫旅行。莎拉未作过多考虑，便和瑞秋踏上旅途。在飞机上，她邂逅了学习人类学的青年凯文&middot;瑞德（Yon Tumarkin 饰），后者对神秘的宗教深感兴趣。于是下了飞机后，莎拉自作主张临时改变行程，带着瑞秋一同随凯文前往耶路撒冷。  青春男女欢呼雀跃，歌舞升平，一度让沙拉忘记了悲伤往事。她兀自沉溺耶路撒冷的夜色中，殊不知却离传说中的地狱之门越来越近&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8102/[阳光电影www.ygdy8.com].地狱之门：耶路撒冷.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160510/50954.html', 'http://i4.tietuku.cn/40541d84f7e6b249.jpg', 'http://i4.buimg.com/892c83e094108f9a.jpg', '2016-06-25 15:40:13');
