INSERT INTO `blog_movie` VALUES ('1268', '死亡格斗/成功的代价', 'Die Fighting', '2014', '美国', '动作/惊悚', '英语', '中英双字幕', '5.0/10 from 327 users', 'BD-RMVB', '1280 x 720', '1CD', '110分钟', 'Fabien Garcia', 'Fabien Garcia ....Fabien Laurent Buson ....Lohan Didier Buson ....Didier Jess Allen ....Jess Dave Vescio ....The Filmmaker Adelyne Liu ....Meilu Xin Sarith Wuku ....Chan Jose Rosete ....Leader of the Hitmen Gray Michael Sallies ....Leader of the Thugs in ', '由四名在少林寺受过武术训练的国外武术爱好者拍摄的《成功的代价》（Die Fighting），四人献上激情澎湃的功夫大餐。 剧情讲述成军于少林寺的武术团队Z-Team，刚刚获得一项电影节的大奖，团队的四名成员法比安、洛汉、迪迪埃与杰斯正踌躇满志憧憬着进军好莱坞，不料却卷入新的危机：一位自称&ldquo;导演&rdquo;的神秘人绑架了四人的爱人，逼迫他们在他的&ldquo;功夫片&rdquo;中，真刀真枪，以命相搏地进行武打。 四人的每一个动作，都被隐蔽处的摄像机记录下来，Z-Team被迫在洛杉矶黑暗的地下世界中打出一条血路，把抢劫犯、武装分子、毒枭、柔道馆、特警队和黑帮一一打了个遍，最终的结局出人意料，每个人都必须思索，为了成功究竟要付出多少代价。 影片可算是四人的&ldquo;本色出演&rdquo;，2000年，三位热爱中国功夫的年轻人雅尼克、法比安&middot;加西亚、洛汉在少林寺结识，他们在寺中接受武术训练，2003年，洛汉的哥哥迪迪埃加盟，四人组成Z-Team和电影制作公司，专门拍摄中国功夫片。这是Z-Team的首支剧情长片。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8096/[阳光电影www.ygdy8.com].死亡格斗.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160429/50834.html', 'http://i3.piimg.com/ae47676d3f90dfcb.jpg', 'http://i2.piimg.com/072c70d4d522b3aa.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1269', '凯撒万岁/凯萨万岁(台)/万千星辉绑架案(港)/致敬恺撒', 'Hail, Caesar!', '2016', '英国/美国', '剧情/喜剧/悬疑/歌舞', '英语', '中英双字幕', '6.7/10 from 30,550 users', 'BD-RMVB', '1280 x 692', '1CD', '106分钟', '伊桑&middot;科恩 Ethan Coen 乔尔&middot;科恩 Joel Coen', '乔什&middot;布洛林 Josh Brolin  乔治&middot;克鲁尼 George Clooney  阿尔登&middot;埃伦瑞奇 Alden Ehrenreich  拉尔夫&middot;费因斯 Ralph Fiennes  乔纳&middot;希尔 Jonah Hill  斯嘉丽&middot;约翰逊 Scarlett Johansson  弗兰西斯&middot;麦克多蒙德 Frances McDormand  蒂尔达&middot;斯文顿 Tilda Swinton  查宁&midd', '大片厂的危机公关高手艾迪（乔什&middot;布洛林），应付麻烦不断的《凯撒万岁：基督的一生》剧组。酗酒主演贝尔德（乔治&middot;克鲁尼）遭苏联人绑架。导演劳伦斯（拉尔夫&middot;费恩斯）令女星（斯嘉丽&middot;约翰逊）意外怀孕，八卦专栏作家（蒂尔达&middot;斯文顿）虎视眈眈，鲜肉演员查宁&middot;塔图姆和阿尔登&middot;埃伦瑞奇也不是省油的灯。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9062/[阳光电影www.ygdy8.com].凯撒万岁.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160527/51065.html', 'http://ww3.sinaimg.cn/mw690/81298caagw1f4881c4am4j21kw2i3qsj.jpg', 'http://i2.buimg.com/11644ba9991ec090.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1270', '美人鱼', 'Mermaid', '2016', '中国/中国香港', '喜剧/爱情/奇幻', '普通话', '中文', '6.8/10 from 1,684 users', 'HD-RMVB', '1280 x 672', '1CD', '1h 33mn 45s', '周星驰 Stephen Chow', '邓超 Chao Deng ....轩少  罗志祥 Show Lo ....八爪鱼  张雨绮 Kitty Zhang ....李若兰  林允 Lin Yun ....人鱼珊珊  孔连顺 Lianshun Kong ....博物馆游客妇人  白客 Ke Bai ....博物馆游客小白  文章 Zhang Wen ....莫探员  李尚正 Shangzheng Li ....史探员  吴亦凡 Kris Wu ....龙剑飞  杨能 Neng Yang ....浴缸人鱼大叔/博物馆馆长  卢正雨 Zhengyu ', '白手起家的富豪刘轩（邓超 饰）新拍下了一块地皮，并联合了女强人李若兰（张雨绮 饰）使用恐怖的声纳技术驱赶鱼类，用于填海造地。人鱼一族长期居住在附近区域的海里，为了继续生存，带头大哥章鱼八哥（罗志祥 饰）派出了美人鱼珊珊（林允 饰）&ldquo;色诱&rdquo;刘轩，准备刺杀。没想到珊珊在卧底过程中与刘轩暗生情愫，一次次破坏暗杀计划，而李若兰却在准备一个更丧心病狂的邪恶计划&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9050/[阳光电影www.ygdy8.com].美人鱼.HD.720p.国语中字.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160419/50766.html', 'http://i3.piimg.com/f00332d7dbe253b0.jpg', 'http://i3.piimg.com/8d87f4f9d6fee95d.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1271', '一路向南/向南(台)/南荒邪教大本营(港)', 'Southbound', '2015', '美国', '悬疑/惊悚/恐怖', '英语', '中英双字幕', '6.0/10 from 2,666 users', 'BD-RMVB', '1280 x 720', '1CD', '89分钟', '罗克珊&middot;本杰明&middot; Roxanne Benjamin 大卫&middot;', '法比娜&middot;泰蕾兹 Fabianne Therese 马特&middot;贝蒂内利-奥尔平 Matt Bettinelli-Olpin 汉娜&middot;马克斯 Hannah Marks 达纳&middot;古尔德 Dana Gould 马特&middot;皮特斯 Matt Peters 提皮尔&middot;牛顿 Tipper Newton 大卫&middot;佑 David Yow 戴维&middot;约翰逊 Davey Johnson 马瑟&middot;泽科尔 Mather Zicke', '一伙人在一个孤立的沙漠公路遇到邪恶势力。 1）米奇与杰克开车来到一家加油站，四周围逡巡着骷髅一样的怪物，他们想要逃离，却总会回到加油站门口。 2）三个爵士乐女孩的汽车路上遇到故障，她们搭乘了一对夫妇的车并来到对方的家里。然而这户人家弥漫着古怪的气息。 3）驱车夜归的男人卢卡斯不慎撞到了其中一名逃出来的爵士女孩。他报警求救，却不知自己身在何处。万般无奈下，他载着女孩前往附近的城镇治疗，但医院空无一人。 4）破旧的酒吧中，突然闯进一名持枪男子要寻找失踪的妹妹，他心急如焚，但他完全没意识到这是一个多么诡异的所在。 5）一家三口回到家中，这时突然有几名戴着面具的人闯了进来。衣冠楚楚的男主人，不知将要为何付出代价。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9091/[阳光电影www.ygdy8.com].一路向南.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160418/50760.html', 'http://i4.tietuku.cn/e79671f7c01c7f77.jpg', 'http://i3.piimg.com/e28664a38adb545d.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1272', '九层妖塔/陆川版鬼吹灯/鬼吹灯之九层妖塔/吹灯传说之精绝古城/鬼吹灯', 'Chronicles of the Ghostly Tribe', '2015', '中国', '动作/惊悚/冒险', '普通话', '中文', '4.7/10 from 267 users', 'BD-RMVB', '1280 x 720', '1CD', '118 Mins', '陆川 Chuan Lu', '赵又廷 Mark Chao 胡八一  姚晨 Chen Yao Shirley杨  冯粒 Li Feng 王胖子  李晨 Chen Li 王馆长  唐嫣 Yan Tang 曹维维  凤小岳 Rhydian Vaughan 陈东  李光洁 Guangjie Li 韩九阳  王庆祥 Qingxiang Wang 杨教授  王德顺 Deshun Wang 安立满  吴军 Jun Wu  林宁 Ning Lin', '1979年，昆仑山发生神秘生物骸骨，由胡八一（赵又廷 饰）率领的探险队深入昆仑山腹地，寻找有关古生物遗迹的更多秘密，却不料在这个过程中遭到不同神秘生物的轮番攻击，并意外坠入九层妖塔，除胡八一外，一行人生死成谜。  胡八一退伍后回到北京，重逢了发小王凯旋（冯粒 饰），并在神秘人（李晨 饰）与科考队（凤小岳、唐嫣、李光洁 饰）两股力量的夹缝中重新踏上了探寻未知文明的征程，途中与Shirley杨（姚晨 饰）邂逅，熟识的面孔唤醒了他身处探险队那段日子的记忆。此行凶险，在还没来得及搞清楚Shirley的真实身份之际，胡八一、Shirley、王胖子率领一行人便在王子墓、石油小镇等地遭到不明生物的轰炸，这里所发生的一切再度指向九层妖塔，而这次等待他们的，将是一个尘封已千年的未解之谜&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y153.dydytt.net:9051/[阳光电影www.ygdy8.com].九层妖塔.BD.720p.国语中字.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160423/50791.html', 'http://i13.tietuku.cn/795f98b3f1c43d54.jpg', 'http://i2.piimg.com/5c80887e5a06cf8e.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1273', '夏洛特烦恼', 'Goodbye Mr.Loser', '2015', '中国', '喜剧', '普通话', '中文', '7.2/10 from 378 users&nbsp;', 'BD-RMVB', '1280 x 720', '1CD', '1h 39mn', '闫非 Fei Yan 彭大魔 Damo Peng', '沈腾 Teng Shen ...夏洛  马丽 Li Ma ...马冬梅  王智 Zhi Wang ...秋雅  艾伦 Allen Ai ...大春  尹正 Zheng Yin ...袁华 田雨 Yu Tian ...王老师 宋阳 Yang Song ...张扬 常远 Yuan Chang ...孟特 李萍 Ping Li ...夏洛妈 李立群 Lichun Lee ...校长 张一鸣 Yiming Zhang', '影片改编自拥有百万粉丝的&ldquo;开心麻花&rdquo;同名经典舞台剧《夏洛特烦恼》。 昔日校花秋雅（王智 饰）的婚礼正在隆重举行，学生时代暗恋秋雅的夏洛（沈腾 饰）看着周围事业成功的老同学，心中泛起酸味，借着七分醉意大闹婚礼现场，甚至惹得妻子马冬梅（马丽 饰）现场发飙，而他发泄过后却在马桶上睡着了。梦里他重回校园，追求到他心爱的女孩、让失望的母亲重展笑颜、甚至成为无所不能的流行乐坛巨星&hellip;&hellip;  醉生梦死中，他发现身边人都在利用自己，只有马冬梅是最值得珍惜的&hellip;&hellip;', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9104/[阳光电影www.ygdy8.com].夏洛特烦恼.BD.720p.国语中字.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160508/50929.html', 'http://ww4.sinaimg.cn/mw690/afdba6bfjw1ewyhnzpb8kj21kw27nu0x.jpg', 'http://i4.buimg.com/ee7e4f96a36c89ed.jpg', '2016-06-25 15:40:13');
INSERT INTO `blog_movie` VALUES ('1274', '飞蛾日记/女校恐怖日记/蛾子日记', 'The Moth Diaries', '2011', '加拿大/爱尔兰', '恐怖', '英语', '中英双字幕', '4.9/10 from 4,653 users', 'BD-RMVB', '1280 x 720', '1CD', '88 Mins', '玛丽&middot;哈伦 Mary Harron', '莎拉&middot;伯格 Sarah Bolger ....Rebecca 莉莉&middot;科尔 Lily Cole ....Ernessa 斯科特&middot;斯比德曼 Scott Speedman ....Mr. Davies Anne Day-Jones ....Rebecca\'s Mother 莎拉&middot;加顿Sarah Gadon ....Lucy Valerie Tian ....Charley Melissa Farman ....Dora Laurence Hamelin .', '美丽女孩蕾贝卡（莎拉&middot;博格 Sarah Bolger 饰）是一家女子教会寄宿学校的学生，开朗热情的她在学校结识了许多好朋友，其中金发女孩露西（莎拉&middot;戈登 Sarah Gadon 饰）与之关系最为融洽。二人形影不离，无话不说，亲密无间。新学期伊始，高挑冷艳的恩妮莎（莉莉&middot;科尔 Lily Cole 饰）转入她们的学校。恩妮莎那妖媚的神秘气息令蕾贝卡备感不适，可是露西似乎对其颇有好感，二人越走越近。与此同时，恩妮莎似乎也勾起蕾贝卡深埋心中的不堪回忆。这个恍如从哥特恐怖小说中走出来的女子，究竟藏着怎样的秘密&hellip;&hellip;  本片根据Rachel Klein 同名畅销科幻恐怖小说。', 'ftp://ygdy8:ygdy8@y219.dydytt.net:9100/[阳光电影www.ygdy8.com].飞蛾日记.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/jddy/20160502/50853.html', 'http://tpimg.ccache.org/images/2015/09/05/121940ba741ba0c79b7fbd04abe90a29.jpg', 'http://i13.tietuku.cn/e7e43e874b879cbb.jpg', '2016-06-25 15:40:13');
