INSERT INTO `blog_movie` VALUES ('1276', '死侍/死侍：不死现身(港)/恶棍英雄：死侍(台)', 'Deadpool', '2016', '美国/加拿大', '喜剧/动作/科幻/冒险', '英语', '中英双字幕', '8.3/10 from 314,172 users', 'BD-RMVB', '1280 x 720', '1CD', '108分钟', '蒂姆&middot;米勒 Tim Miller', '瑞恩&middot;雷诺兹 Ryan Reynolds 饰 &ldquo;死侍&rdquo;韦德&middot;威尔逊 Wade Wilson／Deadpool 莫蕾娜&middot;巴卡林 Morena Baccarin 饰 凡妮莎&middot;杰拉尔丁&middot;卡莱赛尔 Vanessa Geraldine Carlysle 艾德&middot;斯克林 Ed Skrein 饰 &ldquo;阿贾克斯&rdquo;法兰西斯&middot;费里曼 Francis Freeman／Ajax T&mid', '韦德&middot;威尔森本是个身经百战的特种兵，由于得了不治之症而自愿加入&ldquo;X武器计划&rdquo;，他如愿获得金刚狼的基因，从而拥有了金刚狼超人的力量、耐力、速度和强大的自我愈合的能力，但却付出了被毁容的代价。史崔克将军把他作为失败品投入监狱折磨并继续研究，这最终导致死待出逃。拥有强大力量，精通各种武器，并擅长搏击术的死侍对曾经在实验中虐待他的阿贾克斯进行了追杀。不仅如此，他还因为诅咒而拥有了不死之躯，并与各路人马展开了一系列惊险刺激的殊死搏斗。', 'ftp://ygdy8:ygdy8@y153.dydytt.net:8094/[阳光电影www.ygdy8.com].死侍.BD.720p.中英双字幕.rmvb', 'http://www.dytt8.net/html/gndy/dyzz/20160427/50819.html', 'http://pic.yupoo.com/tast0n/FtjZdLh7/7JOlW.jpg', 'http://i2.piimg.com/fe1a0700b59d93d7.jpg', '2016-06-25 15:40:15');
